function MotDePasse
{
	if ($TESTING_MODE)
	{
		Write-Host "Mode test activé. Vérification du mot de passe ignorée."
		return
	}
	$screenWidth = [System.Windows.Forms.Screen]::PrimaryScreen.WorkingArea.Width
	$screenHeight = [System.Windows.Forms.Screen]::PrimaryScreen.WorkingArea.Height
	
	$windowWidth = [int]($screenWidth * 0.15)
	$windowHeight = [int]($screenHeight * 0.05)
	
	$form = New-Object System.Windows.Forms.Form
	$form.Text = 'Sécurité'
	$form.ClientSize = [System.Drawing.Size]::new($windowWidth, $windowHeight)
	$form.StartPosition = 'CenterScreen'
	$form.FormBorderStyle = 'None'
	
	$random = New-Object System.Random
	$randomColor = [System.Drawing.Color]::FromArgb($random.Next(256), $random.Next(256), $random.Next(256))
	$form.BackColor = $randomColor
	
	$label = New-Object System.Windows.Forms.Label
	$label.AutoSize = $true
	$label.Text = 'Mot de passe'
	$label.ForeColor = [System.Drawing.Color]::White
	$form.Controls.Add($label)
	
	$passwordBox = New-Object System.Windows.Forms.TextBox
	$passwordBox.PasswordChar = '*'
	$passwordBox.BackColor = [System.Drawing.Color]::FromArgb(60, 60, 60)
	$passwordBox.ForeColor = [System.Drawing.Color]::White
	$passwordBox.Add_KeyDown({ if ($_.KeyCode -eq 'Enter') { $form.DialogResult = 'OK' } })
	$form.Controls.Add($passwordBox)
	
	$button = New-Object RoundButton
	$button.Text = 'OK'
	$button.DialogResult = 'OK'
	$button.BackColor = [System.Drawing.Color]::FromArgb(70, 70, 70)
	$button.ForeColor = [System.Drawing.Color]::White
	$button.FlatStyle = 'Flat'
	$button.FlatAppearance.BorderSize = 0
	$form.Controls.Add($button)
	
	$form.AcceptButton = $button
	
	$form.Add_Shown({
			$label.Location = [System.Drawing.Point]::new(5, ($form.ClientSize.Height - $label.Height) / 2)
			$passwordBox.Location = [System.Drawing.Point]::new($label.Right + 5, ($form.ClientSize.Height - $passwordBox.Height) / 2)
			$passwordBox.Size = [System.Drawing.Size]::new($form.ClientSize.Width - $label.Width - $button.Width - 20, 20)
			$buttonSize = [Math]::Min($form.ClientSize.Height - 10, 40)
			$button.Size = [System.Drawing.Size]::new($buttonSize, $buttonSize)
			$button.Location = [System.Drawing.Point]::new($form.ClientSize.Width - $button.Width - 5, ($form.ClientSize.Height - $button.Height) / 2)
		})
	
	$attempts = 0
	$maxAttempts = 3
	$correctHash = 'f85e3bc79a5ea6636aacacfbd2a9fb0d69add009fe0ea89b79cf9827185acc35' # SHA256 hash du mot de passe 
	
	while ($attempts -lt $maxAttempts)
	{
		if ($form.ShowDialog() -eq 'OK')
		{
			$inputHash = Get-StringHash $passwordBox.Text
			
			if ($inputHash -eq $correctHash)
			{
				$form.Close()
				return
			}
			else
			{
				$attempts++
				if ($attempts -eq $maxAttempts)
				{
					[System.Windows.Forms.MessageBox]::Show("Nombre maximum de tentatives atteint. Arrêt du script.", "Erreur", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Error)
					$form.Close()
					exit
				}
				$passwordBox.Text = ""
			}
		}
		else
		{
			$form.Close()
			exit
		}
	}
}

function Get-StringHash
{
	param (
		[String]$String
	)
	$StringBuilder = New-Object System.Text.StringBuilder
	[System.Security.Cryptography.HashAlgorithm]::Create("SHA256").ComputeHash([System.Text.Encoding]::UTF8.GetBytes($String)) | ForEach-Object {
		[Void]$StringBuilder.Append($_.ToString("x2"))
	}
	$StringBuilder.ToString()
}


