#00000000000000000000000000000000000000000000000000000000   Installation WINGET et Chocolatey  000000000000000000000000000000000000000000000000000000
function WingetChoco
{
	$script = {
		Set-ExecutionPolicy Bypass -Scope Process -Force
		[System.Net.ServicePointManager]::SecurityProtocol = [System.Net.ServicePointManager]::SecurityProtocol -bor 3072
		Invoke-Expression ((New-Object System.Net.WebClient).DownloadString('https://chocolatey.org/install.ps1'))
	}
	
	$textBox.AppendText("Starting Chocolatey installation...`r`n")
	$chocolateyProcess = Start-Process powershell.exe -ArgumentList "-NoProfile -ExecutionPolicy Bypass -Command `"$script`"" -PassThru
	$chocolateyProcess.WaitForExit()
	
	$textBox.AppendText("Chocolatey installation completed.`r`n")
	Add-Content -Path "C:\temp\logfile.txt" -Value "Chocolatey installed successfully"
	
	$textBox.AppendText("Starting Winget installation...`r`n")
	$wingetProcess = Start-Process -FilePath "choco" -ArgumentList "install anydesk.install winget -y" -PassThru
	$wingetProcess.WaitForExit()
	
	$textBox.AppendText("Winget installation completed.`r`n")
	Add-Content -Path "C:\temp\logfile.txt" -Value "Winget installed successfully"
	
}

#11111111111111111111111111111111111111111111111111111111   Installation WINGET    1111111111111111111111111111111111111111111111111111111111111111111

function WingetInstall
{ # Vérifie l'installation et l'état de WinGet
	function Show-WinGetError
	{
		param (
			[string]$Action,
			[string]$Uri
		)
		
		$choice = Read-Host "Vous avez besoin de WinGet pour continuer. Voulez-vous ouvrir le Microsoft Store pour $Action WinGet ? [Y/N]"
		if ($choice -match '^[Yy]$')
		{
			Start-Process $Uri
		}
	}
	
	function WingetInstall
	{
		[CmdletBinding()]
		param (
			[switch]$Silent,
			[switch]$NoDashes
		)
		
		try
		{
			# Vérifier la connexion Internet
			try
			{
				$internetAvailable = Test-Connection www.microsoft.com -Count 1 -Quiet -ErrorAction Stop
			}
			catch
			{
				$internetAvailable = $false
			}
			
			if (-not $internetAvailable)
			{
				if (-not $Silent)
				{
					Write-Warning "Connexion Internet indisponible. Veuillez vérifier votre connexion."
					Read-Host "Appuyez sur Entrée pour quitter..."
				}
				return 2
			}
			
			# Vérifier l'installation de winget
			if (-not (Get-Command winget -ErrorAction SilentlyContinue))
			{
				if (-not $Silent)
				{
					Show-WinGetError -Action "installer" -Uri "ms-windows-store://pdp/?ProductId=9NBLGGH4NNS1"
				}
				return 1
			}
			
			# Vérifier si winget est à jour
			$wingetCheck = winget search "Microsoft.VisualStudioCode" --accept-source-agreements --accept-package-agreements 2>&1
			if ($LASTEXITCODE -ne 0 -or $wingetCheck -match 'Erreur|failed|Aucune source trouvée')
			{
				if (-not $Silent)
				{
					Write-Warning "WinGet n'est pas à jour ou rencontre un problème."
					Show-WinGetError -Action "mettre à jour" -Uri "ms-windows-store://downloadsandupdates"
				}
				return 1
			}
			
			return 0 # Succès
		}
		catch
		{
			Write-Error "Erreur inattendue : $_"
			return 99
		}
	}
	
	# Appel simplifié de WingetInstall
	$result = WingetInstall -Silent -NoDashes -Verbose
	
	# Affichage du résultat via un simple MessageBox
	Add-Type -AssemblyName System.Windows.Forms
	[System.Windows.Forms.MessageBox]::Show("Code de retour WingetInstall : $result", "Résultat", "OK", "Information")
	
	}
	


