function ProgBase
{
	
	
	Set-ExecutionPolicy Unrestricted -Force -Scope Process
	$appsToInstall = @(
		"Microsoft.Sysinternals --accept-package-agreements",
		"AnyDesk.AnyDesk",
		"7zip.7zip",
		"FastStone.Viewer",
		"Foxit.FoxitReader",
		"Greenshot.Greenshot",
		"Mozilla.Firefox",
		"Notepad++.Notepad++",
		"TeamViewer.TeamViewer",
		"VideoLAN.VLC",
		"RARLab.WinRAR",
		"Microsoft.PowerShell",
		"Adobe.Acrobat.Reader.64-bit",
		"Google.Chrome",
		"CodecGuide.K-LiteCodecPack.Full",
		"paint.net"
	)
	
	foreach ($app in $appsToInstall)
	{
		$output = Start-Process -Wait -FilePath "winget" -ArgumentList "install", $app -PassThru
