		foreach ($path in $commonPaths)
		{
			if ((Test-Path (Join-Path $path "scanstate.exe")) -and (Test-Path (Join-Path $path "loadstate.exe")))
			{
				return $path
			}
		}
		return $null
	}
	
	function Find-USMTPath
	{
		# Chemins possibles d'installation d'USMT avec support ARM/ARM64 - VERSION ÉTENDUE
		$possiblePaths = @(
			# Windows Kits 10 - User State Migration Tool (emplacement standard)
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\amd64",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\x64",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\arm",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\arm64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\amd64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\x64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\arm",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\User State Migration Tool\arm64",
			
			# Windows Kits 10 - Dans Deployment Tools (nouvelles versions)
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\amd64",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\x64",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\arm",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\arm64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\amd64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\x64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\arm",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\USMT\arm64",
			
			# Windows Kits 10 - Directement dans Deployment Tools
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\amd64",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\x64",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\arm",
			"C:\Program Files (x86)\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\arm64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\amd64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\x64",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\arm",
			"C:\Program Files\Windows Kits\10\Assessment and Deployment Kit\Deployment Tools\arm64"
		)
		
		# Détection de l'architecture du système pour prioriser
		$systemArch = $env:PROCESSOR_ARCHITECTURE.ToLower()
		$prioritizedPaths = @()
		
		# Priorisation selon l'architecture système
		switch ($systemArch)
		{
			"amd64" {
				$archPriority = @("amd64", "x64", "arm64", "arm")
			}
			"x64" {
				$archPriority = @("x64", "amd64", "arm64", "arm")
			}
			"arm64" {
				$archPriority = @("arm64", "amd64", "x64", "arm")
			}
			"arm" {
				$archPriority = @("arm", "arm64", "amd64", "x64")
			}
			default {
				$archPriority = @("amd64", "x64", "arm64", "arm")
			}
		}
		
		# Réorganisation des chemins par priorité d'architecture
		foreach ($arch in $archPriority)
		{
			$prioritizedPaths += $possiblePaths | Where-Object { $_ -like "*\$arch" }
		}
		
		# Vérification des chemins priorisés
		foreach ($path in $prioritizedPaths)
		{
			$scanstatePath = Join-Path $path "scanstate.exe"
			$loadstatePath = Join-Path $path "loadstate.exe"
			
			if ((Test-Path $scanstatePath) -and (Test-Path $loadstatePath))
			{
				return $path
			}
		}
		
		# Recherche approfondie dans le système de fichiers
		Write-Output "🔍 Recherche approfondie de USMT..."
		$searchRoots = @(
			"C:\Program Files (x86)\Windows Kits",
			"C:\Program Files\Windows Kits",
			"C:\Windows Kits"
		)
		
		foreach ($root in $searchRoots)
		{
			if (Test-Path $root)
			{
				try
				{
					$foundFiles = Get-ChildItem -Path $root -Recurse -Name "scanstate.exe" -ErrorAction SilentlyContinue
					foreach ($file in $foundFiles)
					{
						$fullPath = Join-Path $root $file
						$directory = Split-Path $fullPath -Parent
						$loadstatePath = Join-Path $directory "loadstate.exe"
						if (Test-Path $loadstatePath)
						{
							Write-Output "✅ USMT trouvé dans : $directory"
							return $directory
						}
					}
				}
				catch
				{
					# Continue si erreur d'accès
				}
			}
		}
		
		return $null
	}
	
	function Get-SystemArchitecture
	{
		$arch = $env:PROCESSOR_ARCHITECTURE.ToLower()
		$wow64 = $env:PROCESSOR_ARCHITEW6432
		
		if ($wow64)
		{
			return $wow64.ToLower()
		}
		return $arch
	}
	
	function Test-USMTInstalled
	{
		$usmtPath = Find-USMTPath-Fast
		if ($usmtPath -ne $null -and $usmtPath -ne "")
		{
			return (Test-Path $usmtPath)
		}
		return $false
	}
	
	function Install-USMT
	{
		$adkUrl = "https://go.microsoft.com/fwlink/?linkid=2243390"
		$adkSetup = "$env:TEMP\adksetup.exe"
		Write-Output "Téléchargement de l'installeur ADK..."
		try
		{
			Invoke-WebRequest -Uri $adkUrl -OutFile $adkSetup -UseBasicParsing
			Write-Output "Installation de l'ADK avec USMT..."
			
			# Installation spécifique d'USMT - plusieurs tentatives avec différents paramètres
			$installAttempts = @(
				"/quiet /features OptionId.UserStateMigrationTool",
				"/quiet /features OptionId.DeploymentTools OptionId.UserStateMigrationTool",
				"/quiet /features +",
				"/quiet /installpath `"C:\Program Files (x86)\Windows Kits\10`" /features OptionId.UserStateMigrationTool"
			)
			
			$installSuccess = $false
			
			foreach ($args in $installAttempts)
			{
				Write-Output "Tentative d'installation avec : $args"
				$process = Start-Process -FilePath $adkSetup -ArgumentList $args -Wait -PassThru -NoNewWindow
				
				# Vérifier si USMT est maintenant installé
				Start-Sleep -Seconds 5
				if (Test-USMTInstalled)
				{
					Write-Output "✅ USMT installé avec succès !"
					$installSuccess = $true
					break
				}
				elseif ($process.ExitCode -eq 0)
				{
					Write-Output "Installation terminée (code: $($process.ExitCode)), vérification..."
					Start-Sleep -Seconds 10
					if (Test-USMTInstalled)
					{
						Write-Output "✅ USMT installé avec succès !"
						$installSuccess = $true
						break
					}
				}
				else
				{
					Write-Output "⚠️ Tentative échouée (code: $($process.ExitCode))"
				}
			}
			
			return $installSuccess
		}
		catch
		{
			Write-Error "Erreur lors de l'installation : $($_.Exception.Message)"
			return $false
		}
	}
	
	function Test-WingetInstalled
	{
		try
		{
			$null = Get-Command winget -ErrorAction Stop
			return $true
		}
		catch
		{
			return $false
		}
	}
	
	function Install-Winget
	{
		try
		{
			Write-Output "Installation de Winget..."
			$progressPreference = 'silentlyContinue'
			$latestWingetMsixBundleUri = $(Invoke-RestMethod https://api.github.com/repos/microsoft/winget-cli/releases/latest).assets.browser_download_url | Where-Object { $_.EndsWith(".msixbundle") }
			$latestWingetMsixBundle = Split-Path $latestWingetMsixBundleUri -Leaf
			Write-Information "Téléchargement de $latestWingetMsixBundle..."
			Invoke-WebRequest -Uri $latestWingetMsixBundleUri -OutFile "$env:TEMP\$latestWingetMsixBundle"
			Add-AppxPackage "$env:TEMP\$latestWingetMsixBundle"
			Write-Output "Winget installé avec succès."
			return $true
		}
		catch
		{
			Write-Error "Erreur lors de l'installation de Winget : $($_.Exception.Message)"
			return $false
		}
	}
	
