	function Show-ComponentSelector
	{
		param ([hashtable]$Components,
			[string]$TargetPath)
		
		# Version simplifiée avec MessageBox pour éviter les erreurs WPF
		$message = "Sélection des composants à migrer :`n`n"
		$message += "COMPOSANTS DISPONIBLES :`n"
		$message += "========================`n`n"
		
		$message += "📁 DOSSIERS UTILISATEUR :`n"
		$message += "• Documents (~5-20 GB) - Recommandé`n"
		$message += "• Images (~1-50 GB) - Recommandé`n"
		$message += "• Musique (~1-20 GB) - Recommandé`n"
		$message += "• Bureau (~100 MB) - Recommandé`n"
		$message += "• Favoris (~10 MB) - Recommandé`n"
		$message += "• Vidéos (~10-200 GB) - NON recommandé (très volumineux)`n`n"
		
		$message += "🖥️ APPLICATIONS :`n"
		$message += "• Microsoft Office 2016 (~2-5 GB) - Recommandé`n"
		$message += "• Menu Démarrer (~20 MB) - Recommandé`n"
		$message += "• Explorateur Windows (~100 MB) - Recommandé`n`n"
		
		$message += "⚙️ PARAMÈTRES SYSTÈME :`n"
		$message += "• Personnalisation (~50 MB) - Recommandé`n"
		$message += "• Réseaux WiFi (~5 MB) - Recommandé`n"
		$message += "• Sons système (~10 MB) - Recommandé`n`n"
		
		$message += "ESTIMATION : Migration sélective ~10-30 GB`n"
		$message += "(au lieu de ~400+ GB en mode complet)`n`n"
		
		$message += "Voulez-vous utiliser cette sélection recommandée ?`n"
		$message += "(Exclut les vidéos volumineux pour une migration rapide)"
		
		$result = [System.Windows.MessageBox]::Show($message, "Sélection des Composants", "YesNo", "Question")
		
		if ($result -eq "Yes")
		{
			# Création d'une sélection prédéfinie optimisée
			$selectedComponents = @(
				@{ Category = "Dossiers"; Component = "Documents"; Selected = $true }
				@{ Category = "Dossiers"; Component = "Images"; Selected = $true }
				@{ Category = "Dossiers"; Component = "Musique"; Selected = $true }
				@{ Category = "Dossiers"; Component = "Bureau"; Selected = $true }
				@{ Category = "Dossiers"; Component = "Favoris"; Selected = $true }
				@{ Category = "Applications"; Component = "Office"; Selected = $true }
				@{ Category = "Applications"; Component = "StartMenu"; Selected = $true }
				@{ Category = "Paramètres"; Component = "Personnalisation"; Selected = $true }
				@{ Category = "Paramètres"; Component = "WiFi"; Selected = $true }
			)
			
			# Sauvegarde de la sélection
			$selectionPath = Join-Path $TargetPath "selected_components.json"
			$selectedComponents | ConvertTo-Json -Depth 3 | Out-File -FilePath $selectionPath -Encoding UTF8
			
			return $selectedComponents
		}
		
		return $null
	}
	
	function Start-USMTGui
	{
		[xml]$xaml = @"
<Window xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
        xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
        Title="USMT GUI Avancé" Height="650" Width="520">
