                    <TextBlock Text="(Vérifie quelles apps sont disponibles dans Winget - peut prendre 10+ minutes)" 
                              FontSize="9" Foreground="Orange" Margin="40,2,0,0"/>
                </StackPanel>
            </GroupBox>
            
            <!-- Section Mode Prescan -->
            <GroupBox Header="Mode Prescan (Sélection avancée)" Margin="0,0,0,10">
                <StackPanel Margin="5">
                    <CheckBox x:Name="PrescanModeChk" Content="Activer le mode prescan (sélection manuelle)" IsChecked="False"/>
                    <TextBlock Text="(Permet de choisir précisément les composants et dossiers à migrer)" 
                              FontSize="10" Foreground="Gray" Margin="20,2,0,5"/>
                    <Button x:Name="PrescanBtn" Content="Lancer Prescan" Width="120" Height="25" 
                           Margin="20,5,0,0" HorizontalAlignment="Left" IsEnabled="False"/>
                    <TextBlock Text="Taille estimée : Non calculée" x:Name="SizeEstimateText" 
                              FontSize="10" Foreground="Blue" Margin="20,5,0,0"/>
                </StackPanel>
            </GroupBox>
            
            <!-- Section Options Avancées -->
            <GroupBox Header="Options de Performance" Margin="0,0,0,10">
                <StackPanel Margin="5">
                    <CheckBox x:Name="FastUSMTChk" Content="Recherche USMT simplifiée (RAPIDE)" IsChecked="True"/>
                    <TextBlock Text="(Cherche uniquement dans les emplacements standards)" 
                              FontSize="10" Foreground="Gray" Margin="20,2,0,5"/>
                    <CheckBox x:Name="SkipVerificationChk" Content="Export direct sans vérifications (TRÈS RAPIDE)" IsChecked="False"/>
                    <TextBlock Text="(Ignore les vérifications de sécurité - pour tests uniquement)" 
                              FontSize="10" Foreground="Red" Margin="20,2,0,0"/>
                </StackPanel>
            </GroupBox>
            
            <!-- Section Chemin -->
            <GroupBox Header="Dossier de sauvegarde/restauration" Margin="0,0,0,10">
