"@
		
		$reader = New-Object System.Xml.XmlNodeReader $xaml
		$window = [Windows.Markup.XamlReader]::Load($reader)
		
		# Récupération des contrôles
		$exportBtn = $window.FindName("ExportBtn")
		$importBtn = $window.FindName("ImportBtn")
		$exportAppsChk = $window.FindName("ExportAppsChk")
		$wingetCompatibilityChk = $window.FindName("WingetCompatibilityChk")
		$prescanModeChk = $window.FindName("PrescanModeChk")
		$prescanBtn = $window.FindName("PrescanBtn")
		$sizeEstimateText = $window.FindName("SizeEstimateText")
		$fastUSMTChk = $window.FindName("FastUSMTChk")
		$skipVerificationChk = $window.FindName("SkipVerificationChk")
		$pathBox = $window.FindName("PathBox")
		$browseBtn = $window.FindName("BrowseBtn")
		$installBtn = $window.FindName("InstallBtn")
		$installWingetBtn = $window.FindName("InstallWingetBtn")
		$launchBtn = $window.FindName("LaunchBtn")
		$logBox = $window.FindName("LogBox")
		
		# Fonction pour ajouter du texte au log
		function Add-LogText
		{
			param ([string]$Text)
			$timestamp = Get-Date -Format "HH:mm:ss"
			$logBox.Text += "[$timestamp] $Text`n"
			$window.UpdateLayout()
			[System.Windows.Forms.Application]::DoEvents()
		}
		
		# Vérification initiale
		$systemArch = Get-SystemArchitecture
		Add-LogText "Interface USMT initialisée (Architecture: $systemArch)"
		
		# Vérification d'USMT
		try
		{
			$useFastSearch = $true # Par défaut en mode rapide
			$usmtPath = if ($useFastSearch) { Find-USMTPath-Fast }
			else { Find-USMTPath }
			
			if ([string]::IsNullOrEmpty($usmtPath))
			{
				Add-LogText "⚠️ USMT non détecté - installation requise"
			}
			else
			{
				try
				{
					if (Test-Path -Path $usmtPath -PathType Container)
					{
						$detectedArch = Split-Path $usmtPath -Leaf
						Add-LogText "✅ USMT détecté ($detectedArch) : $usmtPath"
					}
					else
					{
						Add-LogText "⚠️ USMT trouvé mais chemin inaccessible : $usmtPath"
					}
				}
				catch
				{
					Add-LogText "⚠️ USMT trouvé mais erreur d'accès : $usmtPath"
				}
			}
		}
		catch
		{
			Add-LogText "⚠️ Erreur lors de la recherche USMT - installation requise"
		}
		
		# Vérification de Winget
		if (Test-WingetInstalled)
		{
			Add-LogText "✅ Winget détecté"
		}
		else
		{
			Add-LogText "⚠️ Winget non détecté - installation recommandée"
		}
		
		# Événements pour le mode prescan
		$prescanModeChk.Add_Checked({
				$prescanBtn.IsEnabled = $true
				Add-LogText "📋 Mode prescan activé - permet la sélection manuelle des composants"
			})
		
		$prescanModeChk.Add_Unchecked({
				$prescanBtn.IsEnabled = $false
				$sizeEstimateText.Text = "Taille estimée : Non calculée"
				Add-LogText "📋 Mode prescan désactivé - migration complète"
			})
		
		$prescanBtn.Add_Click({
				$target = $pathBox.Text.Trim()
				
				if ([string]::IsNullOrEmpty($target))
				{
					[System.Windows.MessageBox]::Show("Veuillez sélectionner un dossier de destination.", "Dossier requis", "OK", "Warning")
					return
				}
				
				if (-not (Test-Path $target))
				{
					try
					{
						New-Item -Path $target -ItemType Directory -Force | Out-Null
					}
					catch
					{
						[System.Windows.MessageBox]::Show("Impossible de créer le dossier : $target", "Erreur", "OK", "Error")
						return
					}
				}
				
				try
				{
					Add-LogText "🔍 Lancement du prescan..."
					
					# Utilisation directe sans paramètres pour éviter l'erreur
					$selectedComponents = Show-ComponentSelector -Components @{ } -TargetPath $target
					
					if ($selectedComponents)
					{
						$selectedCount = $selectedComponents.Count
						Add-LogText "✅ Prescan terminé : $selectedCount composants sélectionnés"
						$sizeEstimateText.Text = "Taille estimée : Sélection personnalisée ($selectedCount éléments)"
					}
					else
					{
						Add-LogText "❌ Prescan annulé par l'utilisateur"
					}
				}
				catch
				{
					Add-LogText "❌ Erreur prescan : $($_.Exception.Message)"
				}
			})
		
		# Événements
		$browseBtn.Add_Click({
				$dialog = New-Object System.Windows.Forms.FolderBrowserDialog
				$dialog.Description = "Sélectionnez le dossier de sauvegarde/restauration"
				if ($dialog.ShowDialog() -eq "OK")
				{
					$pathBox.Text = $dialog.SelectedPath
					Add-LogText "Dossier sélectionné : $($dialog.SelectedPath)"
				}
			})
		
		$installBtn.Add_Click({
				Add-LogText "🔄 Installation d'USMT en cours..."
				$window.UpdateLayout()
				if (Install-USMT)
				{
					Add-LogText "✅ USMT installé avec succès"
				}
				else
				{
					Add-LogText "❌ Échec de l'installation d'USMT"
				}
			})
		
		$installWingetBtn.Add_Click({
				Add-LogText "🔄 Installation de Winget en cours..."
				$window.UpdateLayout()
				if (Install-Winget)
				{
					Add-LogText "✅ Winget installé avec succès"
				}
				else
				{
					Add-LogText "❌ Échec de l'installation de Winget"
				}
			})
		
		$launchBtn.Add_Click({
				$target = $pathBox.Text.Trim()
				
				if ([string]::IsNullOrEmpty($target))
				{
					[System.Windows.MessageBox]::Show("Veuillez sélectionner un dossier.", "Erreur", "OK", "Warning")
					return
				}
				
				if (-not (Test-Path $target))
				{
					try
					{
						New-Item -Path $target -ItemType Directory -Force | Out-Null
						Add-LogText "📁 Dossier créé : $target"
					}
					catch
					{
						[System.Windows.MessageBox]::Show("Impossible de créer le dossier : $target", "Erreur", "OK", "Error")
						return
					}
				}
				
				$isExport = $exportBtn.IsChecked
				$includeApps = $exportAppsChk.IsChecked
				$testCompatibility = $wingetCompatibilityChk.IsChecked
				$useFastUSMT = $fastUSMTChk.IsChecked
				$skipVerification = $skipVerificationChk.IsChecked
				$usePrescan = $prescanModeChk.IsChecked
				
				if ($skipVerification)
				{
					Add-LogText "⚡ MODE RAPIDE activé - vérifications désactivées"
				}
				
				if ($usePrescan)
				{
					# Vérifier si un prescan a été fait
					$selectionPath = Join-Path $target "selected_components.json"
					if (-not (Test-Path $selectionPath))
					{
						[System.Windows.MessageBox]::Show("Mode prescan activé mais aucune sélection trouvée.`nVeuillez cliquer sur 'Lancer Prescan' d'abord.", "Prescan requis", "OK", "Warning")
						return
					}
					Add-LogText "📋 Mode prescan activé - utilisation de la sélection personnalisée"
				}
				
				try
				{
					# USMT
					try
					{
						$usmtPath = if ($useFastUSMT) { Find-USMTPath-Fast }
						else { Find-USMTPath }
						
						if ([string]::IsNullOrEmpty($usmtPath))
						{
							Add-LogText "❌ USMT non trouvé. Veuillez l'installer d'abord."
							if (-not $skipVerification)
							{
								[System.Windows.MessageBox]::Show("USMT n'est pas installé ou introuvable.`nVeuillez cliquer sur 'Installer USMT' d'abord.", "USMT manquant", "OK", "Warning")
							}
							return
						}
						
						if (-not $skipVerification -and -not (Test-Path -Path $usmtPath -PathType Container))
						{
							Add-LogText "❌ USMT - chemin inaccessible : $usmtPath"
							return
						}
						
						Add-LogText "📍 USMT trouvé ($((Split-Path $usmtPath -Leaf))) : $usmtPath"
						
						$cmd = if ($isExport) { "scanstate.exe" }
						else { "loadstate.exe" }
						$exePath = Join-Path $usmtPath $cmd
						
						$storePath = Join-Path $target "USMT_Store"
						$logPath = Join-Path $target "usmt_log.txt"
						
						# Construction des arguments selon le mode
						if ($usePrescan -and $isExport)
						{
							# Mode prescan - utiliser seulement les composants de base pour simplifier
							Add-LogText "📋 Mode prescan activé - migration sélective"
							$args = "`"$storePath`" /c /v:13 /i:`"$usmtPath\MigUser.xml`" /l:`"$logPath`" /progress:`"$target\progress.log`""
							Add-LogText "🎯 Lancement de l'export USMT personnalisé..."
						}
						else
						{
							# Mode standard
							if ($isExport)
							{
								$args = "`"$storePath`" /c /v:13 /i:`"$usmtPath\MigApp.xml`" /i:`"$usmtPath\MigDocs.xml`" /i:`"$usmtPath\MigUser.xml`" /l:`"$logPath`" /progress:`"$target\progress.log`""
								Add-LogText "🔄 Lancement de l'export USMT standard..."
							}
							else
							{
								$args = "`"$storePath`" /c /v:13 /i:`"$usmtPath\MigApp.xml`" /i:`"$usmtPath\MigDocs.xml`" /i:`"$usmtPath\MigUser.xml`" /l:`"$logPath`" /progress:`"$target\progress.log`""
								Add-LogText "🔄 Lancement de l'import USMT..."
							}
						}
						
						Add-LogText "Commande : $cmd $args"
						
						$process = Start-Process -FilePath $exePath -ArgumentList $args -NoNewWindow -PassThru
						
						# Attendre la fin du processus avec mise à jour du statut
						while (-not $process.HasExited)
						{
							Start-Sleep -Seconds 2
							Add-LogText "⏳ Migration en cours..."
						}
						
						if ($process.ExitCode -eq 0)
						{
							Add-LogText "✅ Migration USMT terminée avec succès"
						}
						else
						{
							Add-LogText "⚠️ Migration USMT terminée avec des avertissements (Code: $($process.ExitCode))"
						}
						
						Add-LogText "📄 Consultez les logs détaillés : $logPath"
						
					}
					catch
					{
						Add-LogText "❌ Erreur USMT : $($_.Exception.Message)"
					}
					
				}
				catch
				{
					Add-LogText "❌ Erreur : $($_.Exception.Message)"
				}
			})
		
		# Affichage de la fenêtre
		$window.ShowDialog() | Out-Null
	}
	
	# Démarrage de l'interface
	Start-USMTGui
}
