	# Fonction pour ajouter l'étiquette de la catégorie
	function Add-CategoryLabel
	{
		param (
			[string]$category,
			[int]$column,
			[int]$row
		)
		
		$label = New-Object System.Windows.Forms.Label
		$label.Text = $category
		$label.Font = New-Object System.Drawing.Font("Times New Roman", $fontSize, [System.Drawing.FontStyle]::Bold)
		$label.AutoSize = $true
		$label.Top = 30 * $row
		$label.Left = $column * $columnWidth + 20
		$label.ForeColor = [System.Drawing.Color]::DarkBlue
		$fenetre.Controls.Add($label)
		
		return $label.Height
	}
	
	foreach ($category in $logiciels.Keys)
	{
		$backgroundColor = $backgroundColors[$category]
		
		# Ajouter l'étiquette de la catégorie
		$labelHeight = Add-CategoryLabel -category $category -column $currentColumn -row ($i % $rows)
		$i++
		
		# Trier les logiciels de la catégorie par ordre alphabétique
		$sortedSoftware = $logiciels[$category].GetEnumerator() | Sort-Object Name
		
		foreach ($softwareEntry in $sortedSoftware)
		{
			$logiciel = $softwareEntry.Name
			$wingetID = $softwareEntry.Value
			
			$column = [Math]::Min([Math]::Floor($i / $rows), ($desiredColumns - 1))
			$row = $i % $rows
			
			# Si on change de colonne, réinitialiser $i
			if ($column -gt $currentColumn)
			{
				$i = $column * $rows
				$row = 0
				$currentColumn = $column
				
				# Ajouter l'étiquette de la catégorie dans la nouvelle colonne
				$labelHeight = Add-CategoryLabel -category $category -column $currentColumn -row $row
				$i++
				$row = $i % $rows
			}
			
			$checkBox = New-Object System.Windows.Forms.CheckBox
			$checkBox.Text = $logiciel
			$checkBox.Top = 30 * $row
			$checkBox.Left = $column * $columnWidth + 30
			$checkBox.AutoSize = $true
			$checkBox.ForeColor = [System.Drawing.Color]::Black
			$checkBox.BackColor = $backgroundColor
			$checkBox.Font = $font
			$checkBox.Tag = $wingetID # Stocke l'ID winget dans la propriété Tag
			$fenetre.Controls.Add($checkBox)
			
			$i++
		}
		
		# Ajouter un petit espace après chaque catégorie
		$i += $categorySpacing
		
		# Si l'ajout de l'espace nous fait passer à la colonne suivante, ajuster $i
		if ([Math]::Floor($i / $rows) -gt $currentColumn)
		{
			$i = ($currentColumn + 1) * $rows
		}
		
		# Si nous dépassons le nombre de colonnes souhaité, passer à la ligne suivante de la dernière colonne
		if ($currentColumn -ge ($desiredColumns - 1))
		{
			$i = ($desiredColumns - 1) * $rows + ($i % $rows)
			$currentColumn = $desiredColumns - 1
		}
	}
	
	# Fonction pour installer un logiciel avec gestion des erreurs
	function Install-Software
	{
		param (
			[string]$softwareName,
			[string]$wingetID
		)
		
		# Créer un objet pour stocker les logs
		$logPath = "$env:TEMP\winget_install_$([DateTime]::Now.ToString('yyyyMMdd_HHmmss')).log"
		
		try
		{
			Write-Host "Installation de $softwareName en cours..." -ForegroundColor Yellow
			
			# Vérifier s'il y a des options spéciales dans l'ID
			if ($wingetID -match "^(.+?)(\s+--\S+.*)$")
			{
				$actualID = $matches[1]
				$options = $matches[2]
				$process = Start-Process -FilePath "winget" -ArgumentList "install $actualID $options --accept-source-agreements --accept-package-agreements" -Wait -PassThru -ErrorAction Stop
			}
			else
			{
				$process = Start-Process -FilePath "winget" -ArgumentList "install $wingetID --accept-source-agreements --accept-package-agreements" -Wait -PassThru -ErrorAction Stop
			}
			
			if ($process.ExitCode -eq 0)
			{
				Write-Host "✅ $softwareName installé avec succès." -ForegroundColor Green
				"$(Get-Date) - $softwareName installé avec succès." | Out-File -Append -FilePath $logPath
				return $true
			}
			else
			{
				Write-Host "❌ Échec de l'installation de $softwareName. Code d'erreur : $($process.ExitCode)" -ForegroundColor Red
				"$(Get-Date) - Échec de l'installation de $softwareName. Code d'erreur : $($process.ExitCode)" | Out-File -Append -FilePath $logPath
				return $false
			}
		}
		catch
		{
			Write-Host "❌ Erreur lors de l'installation de $softwareName : $_" -ForegroundColor Red
			"$(Get-Date) - Erreur lors de l'installation de $softwareName : $_" | Out-File -Append -FilePath $logPath
			return $false
		}
	}
	
	# Fonction pour désinstaller un logiciel avec gestion des erreurs
	function Uninstall-Software
	{
		param (
			[string]$softwareName,
			[string]$wingetID
		)
		
		# Créer un objet pour stocker les logs
		$logPath = "$env:TEMP\winget_uninstall_$([DateTime]::Now.ToString('yyyyMMdd_HHmmss')).log"
		
		try
		{
			Write-Host "Désinstallation de $softwareName en cours..." -ForegroundColor Yellow
			
			# Vérifier s'il y a des options spéciales dans l'ID
			if ($wingetID -match "^(.+?)(\s+--\S+.*)$")
			{
				$actualID = $matches[1]
				$options = $matches[2]
				$process = Start-Process -FilePath "winget" -ArgumentList "uninstall $actualID $options" -Wait -PassThru -ErrorAction Stop
			}
			else
			{
				$process = Start-Process -FilePath "winget" -ArgumentList "uninstall $wingetID" -Wait -PassThru -ErrorAction Stop
			}
			
			if ($process.ExitCode -eq 0)
			{
				Write-Host "✅ $softwareName désinstallé avec succès." -ForegroundColor Green
				"$(Get-Date) - $softwareName désinstallé avec succès." | Out-File -Append -FilePath $logPath
				return $true
			}
			else
			{
				Write-Host "❌ Échec de la désinstallation de $softwareName. Code d'erreur : $($process.ExitCode)" -ForegroundColor Red
				"$(Get-Date) - Échec de la désinstallation de $softwareName. Code d'erreur : $($process.ExitCode)" | Out-File -Append -FilePath $logPath
				return $false
			}
		}
		catch
		{
			Write-Host "❌ Erreur lors de la désinstallation de $softwareName : $_" -ForegroundColor Red
			"$(Get-Date) - Erreur lors de la désinstallation de $softwareName : $_" | Out-File -Append -FilePath $logPath
			return $false
		}
	}
	
	# Fonction pour installer les logiciels sélectionnés avec barre de progression
	function Install-SelectedSoftware
	{
		$selectedSoftware = $fenetre.Controls | Where-Object { $_ -is [System.Windows.Forms.CheckBox] -and $_.Checked }
		$totalSelected = $selectedSoftware.Count
		
		if ($totalSelected -eq 0)
		{
			[System.Windows.Forms.MessageBox]::Show("Aucun logiciel sélectionné.", "Information", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Information)
			return
		}
		
		$progressForm = New-Object System.Windows.Forms.Form
		$progressForm.Text = "Installation en cours..."
		$progressForm.Size = New-Object System.Drawing.Size(400, 150)
		$progressForm.StartPosition = [System.Windows.Forms.FormStartPosition]::CenterScreen
		$progressForm.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::FixedDialog
		$progressForm.MaximizeBox = $false
		$progressForm.MinimizeBox = $false
		
		$progressBar = New-Object System.Windows.Forms.ProgressBar
		$progressBar.Location = New-Object System.Drawing.Point(10, 50)
		$progressBar.Size = New-Object System.Drawing.Size(360, 30)
		$progressBar.Minimum = 0
		$progressBar.Maximum = $totalSelected
		$progressBar.Value = 0
		$progressForm.Controls.Add($progressBar)
		
		$statusLabel = New-Object System.Windows.Forms.Label
		$statusLabel.Location = New-Object System.Drawing.Point(10, 20)
		$statusLabel.Size = New-Object System.Drawing.Size(360, 20)
		$statusLabel.Text = "Préparation de l'installation..."
		$progressForm.Controls.Add($statusLabel)
		
		# Démarrer l'opération dans un nouveau thread pour ne pas bloquer l'interface
		$progressForm.Show()
		$progressForm.Refresh()
		
		$current = 0
		$success = 0
		$failed = 0
		
		foreach ($checkbox in $selectedSoftware)
		{
			$softwareName = $checkbox.Text
			$wingetID = $checkbox.Tag
			
			$statusLabel.Text = "Installation de $softwareName ($($current + 1)/$totalSelected)..."
			$progressForm.Refresh()
			
			if (Install-Software -softwareName $softwareName -wingetID $wingetID)
			{
				$success++
			}
			else
			{
				$failed++
			}
			
			$current++
			$progressBar.Value = $current
			$progressForm.Refresh()
		}
		
		$statusLabel.Text = "Installation terminée : $success réussies, $failed échouées"
		$progressBar.Value = $progressBar.Maximum
		$progressForm.Refresh()
		
		[System.Windows.Forms.MessageBox]::Show("Installation terminée : $success réussies, $failed échouées", "Résultat", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Information)
		$progressForm.Close()
	}
	# Fonction pour vérifier si un identifiant Winget existe
	function Test-WingetIdExists
	{
		param (
			[string]$wingetID
		)
		
		try
		{
			$output = & winget search --id $wingetID --exact 2>&1
			# Si l'ID existe, la recherche retournera au moins un résultat
			return $output -match $wingetID
		}
		catch
		{
			return $false
		}
	}
	
	# Fonction pour vérifier tous les identifiants Winget dans la liste
	function Verify-AllWingetIds
	{
		$statusLabel.Text = "Vérification des identifiants Winget..."
		$fenetre.Refresh()
		
		$invalidIds = @()
		
		foreach ($category in $logiciels.Keys)
		{
			foreach ($softwareEntry in $logiciels[$category].GetEnumerator())
			{
				$logiciel = $softwareEntry.Name
				$wingetID = $softwareEntry.Value
				
				if (-not (Test-WingetIdExists -wingetID $wingetID))
				{
					$invalidIds += "$logiciel : $wingetID"
				}
			}
		}
		
		if ($invalidIds.Count -gt 0)
		{
			$statusLabel.Text = "$($invalidIds.Count) identifiants Winget invalides détectés."
			[System.Windows.Forms.MessageBox]::Show(
				"Les identifiants Winget suivants pourraient être invalides ou inexistants :`n`n" + ($invalidIds -join "`n"),
				"Identifiants invalides",
				[System.Windows.Forms.MessageBoxButtons]::OK,
				[System.Windows.Forms.MessageBoxIcon]::Warning
			)
		}
		else
		{
			$statusLabel.Text = "Tous les identifiants Winget sont valides."
		}
	}
