	$fileMenu.DropDownItems.Add($exitMenuItem)
	
	# Menu Outils
	$toolsMenu = New-Object System.Windows.Forms.ToolStripMenuItem
	$toolsMenu.Text = "Outils"
	
	$refreshMenuItem = New-Object System.Windows.Forms.ToolStripMenuItem
	$refreshMenuItem.Text = "Rafraîchir la liste"
	$refreshMenuItem.Add_Click({
			# Recharger les packages winget
			$statusLabel.Text = "Rafraîchissement de la liste des logiciels..."
			$fenetre.Refresh()
			
			# Logic to refresh would go here
			
			$statusLabel.Text = "Liste des logiciels rafraîchie."
		})
	$toolsMenu.DropDownItems.Add($refreshMenuItem)
	
	$checkUpdatesMenuItem = New-Object System.Windows.Forms.ToolStripMenuItem
	$checkUpdatesMenuItem.Text = "Vérifier les mises à jour"
	$checkUpdatesMenuItem.Add_Click({
			$statusLabel.Text = "Vérification des mises à jour disponibles..."
			$fenetre.Refresh()
			
			try
			{
				$updatesProcess = Start-Process -FilePath "winget" -ArgumentList "upgrade" -Wait -PassThru -ErrorAction Stop
				if ($updatesProcess.ExitCode -eq 0)
				{
					$statusLabel.Text = "Vérification des mises à jour terminée."
				}
