	$toolsMenu.DropDownItems.Add($checkUpdatesMenuItem)
	# AJOUTEZ ICI LE NOUVEL ÉLÉMENT DE MENU
	$verifyIdsMenuItem = New-Object System.Windows.Forms.ToolStripMenuItem
	$verifyIdsMenuItem.Text = "Vérifier les identifiants Winget"
	$verifyIdsMenuItem.Add_Click({ Verify-AllWingetIds })
	$toolsMenu.DropDownItems.Add($verifyIdsMenuItem)
	# Menu Aide
	$helpMenu = New-Object System.Windows.Forms.ToolStripMenuItem
	$helpMenu.Text = "Aide"
	
	$aboutMenuItem = New-Object System.Windows.Forms.ToolStripMenuItem
	$aboutMenuItem.Text = "À propos"
	$aboutMenuItem.Add_Click({
			[System.Windows.Forms.MessageBox]::Show(
				"Gestionnaire de logiciels Windows avec Winget`n`nCette application permet d'installer et de désinstaller facilement des logiciels en utilisant le gestionnaire de paquets Windows (winget).`n`nVersion: 1.0",
				"À propos",
				[System.Windows.Forms.MessageBoxButtons]::OK,
				[System.Windows.Forms.MessageBoxIcon]::Information
			)
		})
	$helpMenu.DropDownItems.Add($aboutMenuItem)
	
	# Ajouter les menus à la barre de menu
	$menuStrip.Items.Add($fileMenu)
	$menuStrip.Items.Add($toolsMenu)
	$menuStrip.Items.Add($helpMenu)
	$fenetre.Controls.Add($menuStrip)
	
	# Ajuster l'interface en fonction de la présence du menu
	$fenetre.Add_Shown({
			# Recalculer les positions des contrôles pour tenir compte de la barre de menu
			foreach ($control in $fenetre.Controls)
			{
				if ($control -is [System.Windows.Forms.CheckBox] -or $control -is [System.Windows.Forms.Label])
				{
					$control.Top += $menuStrip.Height
				}
			}
			
			# Recalculer la position des boutons
			Center-Buttons
		})
	
	# Fonction pour exporter la liste des logiciels sélectionnés
	function Export-SelectedSoftware
	{
		$saveFileDialog = New-Object System.Windows.Forms.SaveFileDialog
		$saveFileDialog.Filter = "Fichiers texte (*.txt)|*.txt|Tous les fichiers (*.*)|*.*"
		$saveFileDialog.Title = "Exporter la liste des logiciels sélectionnés"
		$saveFileDialog.FileName = "logiciels_selectionnes.txt"
		
		if ($saveFileDialog.ShowDialog() -eq [System.Windows.Forms.DialogResult]::OK)
		{
			$selectedSoftware = $fenetre.Controls | Where-Object { $_ -is [System.Windows.Forms.CheckBox] -and $_.Checked }
			
			try
			{
				"# Liste des logiciels sélectionnés" | Out-File -FilePath $saveFileDialog.FileName -Encoding utf8
				"# Généré le $(Get-Date -Format 'yyyy-MM-dd HH:mm:ss')" | Out-File -FilePath $saveFileDialog.FileName -Append -Encoding utf8
				"" | Out-File -FilePath $saveFileDialog.FileName -Append -Encoding utf8
				
				foreach ($software in $selectedSoftware)
				{
					"$($software.Text) : winget install $($software.Tag)" | Out-File -FilePath $saveFileDialog.FileName -Append -Encoding utf8
				}
				
				[System.Windows.Forms.MessageBox]::Show("Liste des logiciels exportée avec succès.", "Export réussi", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Information)
			}
			catch
			{
				[System.Windows.Forms.MessageBox]::Show("Erreur lors de l'exportation: $_", "Erreur", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Error)
			}
		}
	}
	
	# Ajouter l'option d'exportation au menu Fichier
	$exportMenuItem = New-Object System.Windows.Forms.ToolStripMenuItem
	$exportMenuItem.Text = "Exporter la sélection"
	$exportMenuItem.Add_Click({ Export-SelectedSoftware })
	$fileMenu.DropDownItems.Insert(0, $exportMenuItem)
	
	# Vérifier les privilèges d'administrateur
	if (-not ([Security.Principal.WindowsPrincipal][Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator))
	{
		$statusLabel.Text = "Attention: Ce script n'est pas exécuté en tant qu'administrateur. Certaines fonctionnalités pourraient ne pas fonctionner correctement."
	}
	
	# Afficher la fenêtre
	[void]$fenetre.ShowDialog()
}

#9999999999999999999999999999999999999999999999999999999999 onedrive degage   9999999999999999999999999999999999999999999999999999999999999999999
function onedriveoff
{
	#   Description:
	# This script will remove and disable OneDrive integration.
	Write-Output "Kill OneDrive process"
	taskkill.exe /F /IM "OneDrive.exe"
	taskkill.exe /F /IM "explorer.exe"
	
	Write-Output "Remove OneDrive"
	if (Test-Path "$env:systemroot\System32\OneDriveSetup.exe")
	{
		& "$env:systemroot\System32\OneDriveSetup.exe" /uninstall
	}
	if (Test-Path "$env:systemroot\SysWOW64\OneDriveSetup.exe")
	{
		& "$env:systemroot\SysWOW64\OneDriveSetup.exe" /uninstall
	}
	
	Write-Output "Removing OneDrive leftovers"
	Remove-Item -Recurse -Force -ErrorAction SilentlyContinue "$env:localappdata\Microsoft\OneDrive"
	Remove-Item -Recurse -Force -ErrorAction SilentlyContinue "$env:programdata\Microsoft OneDrive"
	Remove-Item -Recurse -Force -ErrorAction SilentlyContinue "$env:systemdrive\OneDriveTemp"
	# check if directory is empty before removing:
	If ((Get-ChildItem "$env:userprofile\OneDrive" -Recurse | Measure-Object).Count -eq 0)
	{
		Remove-Item -Recurse -Force -ErrorAction SilentlyContinue "$env:userprofile\OneDrive"
	}
	
	Write-Output "Disable OneDrive via Group Policies"
	New-FolderForced -Path "HKLM:\SOFTWARE\Wow6432Node\Policies\Microsoft\Windows\OneDrive"
	Set-ItemProperty -Path "HKLM:\SOFTWARE\Wow6432Node\Policies\Microsoft\Windows\OneDrive" "DisableFileSyncNGSC" 1
	
	Write-Output "Remove Onedrive from explorer sidebar"
	New-PSDrive -PSProvider "Registry" -Root "HKEY_CLASSES_ROOT" -Name "HKCR"
	mkdir -Force "HKCR:\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
	Set-ItemProperty -Path "HKCR:\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}" "System.IsPinnedToNameSpaceTree" 0
	mkdir -Force "HKCR:\Wow6432Node\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
	Set-ItemProperty -Path "HKCR:\Wow6432Node\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}" "System.IsPinnedToNameSpaceTree" 0
	Remove-PSDrive "HKCR"
	
	# Thank you Matthew Israelsson
	Write-Output "Removing run hook for new users"
	reg load "hku\Default" "C:\Users\Default\NTUSER.DAT"
	reg delete "HKEY_USERS\Default\SOFTWARE\Microsoft\Windows\CurrentVersion\Run" /v "OneDriveSetup" /f
	reg unload "hku\Default"
	
	Write-Output "Removing startmenu entry"
	Remove-Item -Force -ErrorAction SilentlyContinue "$env:userprofile\AppData\Roaming\Microsoft\Windows\Start Menu\Programs\OneDrive.lnk"
	
	Write-Output "Removing scheduled task"
	Get-ScheduledTask -TaskPath '\' -TaskName 'OneDrive*' -ea SilentlyContinue | Unregister-ScheduledTask -Confirm:$false
	
	Write-Output "Restarting explorer"
	Start-Process "explorer.exe"
	
	Write-Output "Waiting for explorer to complete loading"
	Start-Sleep 10
	
	# This can break Windows Update and some system utilities, see #297.
	#Write-Output "Removing additional OneDrive leftovers"
	#foreach ($item in (Get-ChildItem "$env:WinDir\WinSxS\*onedrive*")) {
	#    Takeown-Folder $item.FullName
	#    Remove-Item -Recurse -Force $item.FullName
	#}
}

