    # Fonction pour tester la compatibilité du processeur avec Windows 11
    function Test-ProcessorCompatibility
    {
        param (
            [Parameter(Mandatory = $true)]
            [string]$ProcessorName
        )
        
        # Détection directe pour les processeurs Intel récents (11ème gen+)
        if ($ProcessorName -match "Intel.*Core.*i[3-9][-]1[1-9]" -or
            $ProcessorName -match "Intel.*Core.*i[3-9][-]?[2-9][0-9]" -or
            $ProcessorName -match "Intel.*Core.*Ultra" -or
            $ProcessorName -match "12th Gen" -or
            $ProcessorName -match "13th Gen" -or
            $ProcessorName -match "14th Gen")
        {
            return $true
        }
        
        # Créer une liste des processeurs compatibles
        $compatibleProcessors = @(
            # Extraction des processeurs Intel compatibles (Core i3/i5/i7/i9 8ème génération et plus)
            "Core i3-8", "Core i3-9", "Core i3-10", "Core i3-11", "Core i3-12", "Core i3-13", "Core i3-14",
            "Core i5-8", "Core i5-9", "Core i5-10", "Core i5-11", "Core i5-12", "Core i5-13", "Core i5-14",
            "Core i7-8", "Core i7-9", "Core i7-10", "Core i7-11", "Core i7-12", "Core i7-13", "Core i7-14",
            "Core i9-8", "Core i9-9", "Core i9-10", "Core i9-11", "Core i9-12", "Core i9-13", "Core i9-14",
            "Core Ultra", # Les processeurs Core Ultra sont tous compatibles
            
            # AMD Ryzen 3/5/7/9 2ème génération (Zen+) et plus
            "Ryzen 3 2", "Ryzen 3 3", "Ryzen 3 4", "Ryzen 3 5", "Ryzen 3 7",
            "Ryzen 5 2", "Ryzen 5 3", "Ryzen 5 4", "Ryzen 5 5", "Ryzen 5 6", "Ryzen 5 7",
            "Ryzen 7 2", "Ryzen 7 3", "Ryzen 7 4", "Ryzen 7 5", "Ryzen 7 6", "Ryzen 7 7",
            "Ryzen 9 3", "Ryzen 9 4", "Ryzen 9 5", "Ryzen 9 6", "Ryzen 9 7",
            
            # AMD Ryzen PRO
            "Ryzen 3 PRO 2", "Ryzen 3 PRO 3", "Ryzen 3 PRO 4", "Ryzen 3 PRO 5", "Ryzen 3 PRO 7",
            "Ryzen 5 PRO 2", "Ryzen 5 PRO 3", "Ryzen 5 PRO 4", "Ryzen 5 PRO 5", "Ryzen 5 PRO 6", "Ryzen 5 PRO 7",
            "Ryzen 7 PRO 2", "Ryzen 7 PRO 3", "Ryzen 7 PRO 4", "Ryzen 7 PRO 5", "Ryzen 7 PRO 6", "Ryzen 7 PRO 7",
            "Ryzen 9 PRO 3", "Ryzen 9 PRO 5", "Ryzen 9 PRO 6",
            
            # Qualcomm Snapdragon
            "Snapdragon 850", "Snapdragon 7c", "Snapdragon 8c", "Snapdragon 8cx",
            "Microsoft SQ1", "Microsoft SQ2", "Microsoft SQ3"
        )
        
        # Vérifier si le processeur correspond à l'un des modèles compatibles
        foreach ($compatProcessor in $compatibleProcessors)
        {
            if ($ProcessorName -match $compatProcessor)
            {
                return $true
            }
        }
        
        # Vérifier les exceptions spécifiques Intel
        $intelExceptions = @(
            "Core i7-7820HQ" # Surface Studio 2 et certains appareils professionnels
        )
        
        foreach ($exception in $intelExceptions)
        {
            if ($ProcessorName -match $exception)
            {
                return $true
            }
        }
        
        # Vérifier les processeurs Xeon et autres processeurs professionnels répertoriés
        $xeonPattern = "Xeon (E-|W-|Gold|Silver|Bronze|Platinum|D-)"
        if ($ProcessorName -match $xeonPattern)
        {
            return $true
        }
        
        # Vérifier les autres processeurs Intel et AMD moins courants
        $otherCompatibleModels = @(
            "Atom x6", "Celeron N6", "Celeron J6",
            "Pentium Gold 6", "Pentium Gold 7", "Pentium Gold 8",
            "Athlon 3", "Athlon Gold", "Athlon Silver"
        )
        
        foreach ($model in $otherCompatibleModels)
        {
            if ($ProcessorName -match $model)
            {
                return $true
            }
        }
        
        # Si aucune correspondance n'a été trouvée, le processeur n'est probablement pas compatible
        return $false
    }
    
    # Fonctions pour obtenir des informations système de manière sécurisée
    function Get-DiskInfoSafely
    {
        try
        {
            $disks = Get-Disk
            return $disks
        }
        catch
        {
            Write-Host "Utilisation de méthode alternative pour obtenir les informations disque..." -ForegroundColor Yellow
            try
            {
                # Alternative utilisant WMI
                $disks = Get-WmiObject -Class Win32_DiskDrive
                return $disks
            }
            catch
            {
                Write-Host "Impossible d'obtenir les informations disque: $($_.Exception.Message)" -ForegroundColor Yellow
                return @()
            }
        }
    }
    
