    # Fonction d'envoi d'email sécurisé
    function Send-ReportEmail
    {
        param (
            [string]$Subject,
            [string]$Body,
            [string[]]$Attachments
        )
        
        if (-not $sendEmailEnabled)
        {
            Write-Host "Envoi d'email désactivé dans la configuration." -ForegroundColor Yellow
            return $false
        }
        
        try
        {
            # Demander les informations d'authentification de manière sécurisée
            $credential = Get-Credential -Message "Entrez les identifiants SMTP pour l'envoi d'email" -UserName $smtpSettings.From
            
            $smtp = New-Object System.Net.Mail.SmtpClient($smtpSettings.Server, $smtpSettings.Port)
            $smtp.EnableSsl = $smtpSettings.UseSSL
            $smtp.Credentials = $credential
            
            $message = New-Object System.Net.Mail.MailMessage
            $message.From = $smtpSettings.From
            $message.To.Add($smtpSettings.To)
            $message.Subject = $Subject
            $message.Body = $Body
            $message.IsBodyHtml = $true
            
            foreach ($attachment in $Attachments)
            {
                if (Test-Path $attachment)
                {
                    $attach = New-Object System.Net.Mail.Attachment($attachment)
                    $message.Attachments.Add($attach)
                }
                else
                {
                    Write-Host "Pièce jointe introuvable : $attachment" -ForegroundColor Yellow
                }
            }
            
            $smtp.Send($message)
            
            # Libérer les ressources
            foreach ($attachment in $message.Attachments)
            {
                $attachment.Dispose()
            }
            $message.Dispose()
            $smtp.Dispose()
            
            return $true
        }
        catch
        {
            Write-Host "Erreur lors de l'envoi de l'email: $($_.Exception.Message)" -ForegroundColor Red
            return $false
        }
    }
    
    $logFile = "$outputFolder\migration_scan.log"
    Write-Log -Message "Début de la collecte d'informations pour $computerName (Utilisateur: $userName, Structure: $structure)" -FilePath $logFile
    
    # 1. Informations système de base
    Write-Log -Message "Collecte des informations système..." -FilePath $logFile
    $systemInfo = Get-ComputerInfo
    $systemInfo | Out-File "$outputFolder\SystemInfo.txt"
    
    # 2. Vérification du BIOS (mode UEFI et état du Secure Boot)
    Write-Log -Message "Vérification du BIOS et Secure Boot..." -FilePath $logFile
    $biosInfo = Get-WmiObject -Class Win32_BIOS
    $secureBootState = $false
    try
    {
        $secureBootState = Confirm-SecureBootUEFI -ErrorAction SilentlyContinue
    }
    catch
    {
        Write-Log -Message "Impossible de vérifier l'état de Secure Boot: $($_.Exception.Message)" -FilePath $logFile
    }
    
    $uefiStatus = "Désactivé"
    try
    {
        if ((Get-ItemProperty -Path "HKLM:\SYSTEM\CurrentControlSet\Control\SecureBoot\State" -ErrorAction SilentlyContinue).UEFISecureBootEnabled -eq 1)
        {
            $uefiStatus = "Activé"
        }
    }
    catch
    {
        Write-Log -Message "Impossible de vérifier l'état UEFI: $($_.Exception.Message)" -FilePath $logFile
    }
    
    "BIOS Version: $($biosInfo.SMBIOSBIOSVersion)" | Out-File "$outputFolder\BIOS_Info.txt"
    "BIOS Date: $($biosInfo.ReleaseDate)" | Out-File "$outputFolder\BIOS_Info.txt" -Append
    "Secure Boot: $secureBootState" | Out-File "$outputFolder\BIOS_Info.txt" -Append
    "Mode UEFI: $uefiStatus" | Out-File "$outputFolder\BIOS_Info.txt" -Append
    
    # 3. Informations TPM
    Write-Log -Message "Vérification TPM..." -FilePath $logFile
    $tpmPresent = $false
    $tpmEnabled = $false
    $tpmVersion = "N/A"
    
    try
    {
        $tpm = Get-Tpm
        $tpmPresent = $tpm.TpmPresent
        $tpmEnabled = $tpm.TpmEnabled
        
        try
        {
            $tpmInfo = Get-WmiObject -Namespace "root\CIMV2\Security\MicrosoftTpm" -Class Win32_Tpm -ErrorAction SilentlyContinue
            if ($tpmInfo)
            {
                $tpmVersion = $tpmInfo.SpecVersion
            }
        }
        catch
        {
            Write-Log -Message "Impossible d'obtenir la version TPM: $($_.Exception.Message)" -FilePath $logFile
        }
    }
    catch
    {
        Write-Log -Message "Impossible d'obtenir les informations TPM via Get-Tpm: $($_.Exception.Message)" -FilePath $logFile
        
        # Méthode alternative avec WMI
        try
        {
            $tpmInfo = Get-WmiObject -Namespace "root\CIMV2\Security\MicrosoftTpm" -Class Win32_Tpm -ErrorAction SilentlyContinue
            if ($tpmInfo)
            {
                $tpmPresent = $true
                $tpmEnabled = $tpmInfo.IsEnabled_InitialValue
                $tpmVersion = $tpmInfo.SpecVersion
            }
        }
        catch
        {
            Write-Log -Message "Impossible d'obtenir les informations TPM via WMI: $($_.Exception.Message)" -FilePath $logFile
        }
    }
    
    "TPM Présent: $tpmPresent" | Out-File "$outputFolder\TPM_Info.txt"
    "TPM Activé: $tpmEnabled" | Out-File "$outputFolder\TPM_Info.txt" -Append
    "TPM Version: $tpmVersion" | Out-File "$outputFolder\TPM_Info.txt" -Append
    
    # 4. Informations processeur
    Write-Log -Message "Collecte des informations processeur..." -FilePath $logFile
    $cpuInfo = Get-WmiObject -Class Win32_Processor | Select-Object Name, Manufacturer, Description, NumberOfCores, NumberOfLogicalProcessors, MaxClockSpeed
    $cpuInfo | Out-File "$outputFolder\CPU_Info.txt"
    
    # 5. Informations RAM
    Write-Log -Message "Collecte des informations mémoire..." -FilePath $logFile
    $ram = Get-WmiObject -Class Win32_PhysicalMemory | Measure-Object -Property Capacity -Sum
    "Mémoire totale installée: $([math]::Round($ram.Sum / 1GB, 2)) GB" | Out-File "$outputFolder\RAM_Info.txt"
    $ramInfo = Get-WmiObject -Class Win32_PhysicalMemory | Select-Object DeviceLocator, Manufacturer, PartNumber, @{ Name = "Capacity(GB)"; Expression = { [math]::Round($_.Capacity / 1GB, 2) } }, Speed
    $ramInfo | Out-File "$outputFolder\RAM_Info.txt" -Append
    
    # 6. Informations disque
    Write-Log -Message "Collecte des informations disque..." -FilePath $logFile
    $diskInfo = Get-DiskInfoSafely
    $volumeInfo = Get-VolumeInfoSafely
    $partitionInfo = Get-PartitionInfoSafely
    $diskInfo | Out-File "$outputFolder\Disk_Info.txt"
    $volumeInfo | Out-File "$outputFolder\Volume_Info.txt"
    $partitionInfo | Out-File "$outputFolder\Partition_Info.txt"
    
    # 7. Informations réseau
    Write-Log -Message "Collecte des informations réseau..." -FilePath $logFile
    $networkAdapters = Get-NetworkAdaptersSafely
    $ipAddresses = Get-IPAddressesSafely
    $networkAdapters | Out-File "$outputFolder\Network_Adapters.txt"
    $ipAddresses | Out-File "$outputFolder\IP_Addresses.txt"
    
    # 8. Logiciels installés
    Write-Log -Message "Inventaire des logiciels installés..." -FilePath $logFile
    $software = Get-WmiObject -Class Win32_Product | Select-Object Name, Version, Vendor | Sort-Object Name
    $software | Out-File "$outputFolder\Installed_Software.txt"
    
    # 9. Liste des pilotes
    Write-Log -Message "Inventaire des pilotes..." -FilePath $logFile
    $drivers = Get-WmiObject Win32_PnPSignedDriver | Select-Object DeviceName, DriverVersion, Manufacturer | Sort-Object DeviceName
    $drivers | Out-File "$outputFolder\Drivers.txt"
    
    # 10. Liste des mises à jour Windows installées
    Write-Log -Message "Liste des mises à jour Windows installées..." -FilePath $logFile
    $updates = Get-HotFix | Sort-Object InstalledOn -Descending
    $updates | Out-File "$outputFolder\Windows_Updates.txt"
    
    # 11. Vérification de la compatibilité avec Windows 11 (exigences basiques)
    Write-Log -Message "Vérification de la compatibilité Windows 11..." -FilePath $logFile
    $processor = Get-WmiObject -Class Win32_Processor
    $physicalMemory = [math]::Round((Get-WmiObject -Class Win32_PhysicalMemory | Measure-Object -Property Capacity -Sum).Sum / 1GB, 2)
    $diskSpace = [math]::Round((Get-WmiObject -Class Win32_LogicalDisk -Filter "DeviceID='C:'" | Select-Object -ExpandProperty FreeSpace) / 1GB, 2)
    
    # Vérifier la compatibilité du modèle de processeur
    $processorModelCompatible = Test-ProcessorCompatibility -ProcessorName $processor.Name
    
    $compatibility = @()
    $compatibility += "Processeur (cœurs): $($processor.Name) - " + $(if ($processor.NumberOfCores -ge 2) { "Compatible" }
        else { "Non compatible (minimum 2 cœurs requis)" })
    $compatibility += "Processeur (modèle): $($processor.Name) - " + $(if ($processorModelCompatible) { "Compatible" }
        else { "Potentiellement non compatible (vérifier sur la liste officielle de Microsoft)" })
    $compatibility += "RAM: $physicalMemory GB - " + $(if ($physicalMemory -ge 4) { "Compatible" }
        else { "Non compatible (minimum 4 GB requis)" })
    $compatibility += "Espace disque libre: $diskSpace GB - " + $(if ($diskSpace -ge 64) { "Compatible" }
        else { "Non compatible (minimum 64 GB requis)" })
    $compatibility += "TPM: " + $(if ($tpmPresent) { "Présent" }
        else { "Non détecté" }) + " - " + $(if ($tpmPresent) { "Compatible" }
        else { "Non compatible (TPM 2.0 requis)" })
    $compatibility += "Secure Boot: " + $(if ($secureBootState) { "Activé" }
        else { "Désactivé" }) + " - " + $(if ($secureBootState) { "Compatible" }
        else { "Configuration requise" })
    $compatibility += "UEFI: " + $(if ($uefiStatus -eq "Activé") { "Activé" }
        else { "Désactivé" }) + " - " + $(if ($uefiStatus -eq "Activé") { "Compatible" }
        else { "Non compatible (UEFI requis)" })
    
    $compatibility | Out-File "$outputFolder\Windows11_Compatibility.txt"
    
    # COLLECTES SUPPLÉMENTAIRES
    
    # 12. Liste des périphériques USB
    Write-Log -Message "Collecte des périphériques USB..." -FilePath $logFile
    $usbDevices = Get-UsbDevicesSafely
    $usbDevices | Out-File "$outputFolder\USB_Devices.txt"
    
    # 13. Liste des imprimantes
    Write-Log -Message "Collecte des imprimantes..." -FilePath $logFile
    $printers = Get-PrintersSafely
    $printers | Out-File "$outputFolder\Printers.txt"
    
    # 14. Liste des services en cours
    Write-Log -Message "Collecte des services..." -FilePath $logFile
    $runningServices = Get-Service | Where-Object { $_.Status -eq "Running" } | Sort-Object DisplayName
    $runningServices | Out-File "$outputFolder\Running_Services.txt"
    
    # 15. Liste des comptes utilisateurs locaux
    Write-Log -Message "Collecte des comptes utilisateurs locaux..." -FilePath $logFile
    try
    {
        $localUsers = Get-LocalUser | Select-Object Name, Enabled, PasswordExpires, LastLogon
        $localUsers | Out-File "$outputFolder\Local_Users.txt"
    }
    catch
    {
        Write-Log -Message "Impossible d'obtenir les comptes utilisateurs locaux: $($_.Exception.Message)" -FilePath $logFile
        # Méthode alternative
        try
        {
            $localUsers = Get-WmiObject -Class Win32_UserAccount -Filter "LocalAccount='True'" | Select-Object Name, Disabled, PasswordChangeable
            $localUsers | Out-File "$outputFolder\Local_Users.txt"
        }
        catch
        {
            Write-Log -Message "Échec de la méthode alternative pour les comptes utilisateurs: $($_.Exception.Message)" -FilePath $logFile
        }
    }
    
    # 16. Liste des informations de démarrage
    Write-Log -Message "Collecte des informations de démarrage..." -FilePath $logFile
    try
    {
        $startupItems = Get-CimInstance Win32_StartupCommand | Select-Object Name, Command, Location, User
        $startupItems | Out-File "$outputFolder\Startup_Items.txt"
    }
    catch
    {
        Write-Log -Message "Impossible d'obtenir les informations de démarrage via CIM: $($_.Exception.Message)" -FilePath $logFile
        # Méthode alternative
        try
        {
            $startupItems = Get-WmiObject Win32_StartupCommand | Select-Object Name, Command, Location, User
            $startupItems | Out-File "$outputFolder\Startup_Items.txt"
        }
        catch
        {
            Write-Log -Message "Échec de la méthode alternative pour les informations de démarrage: $($_.Exception.Message)" -FilePath $logFile
        }
    }
    
    # 17. Liste des cartes graphiques
    Write-Log -Message "Collecte des informations des cartes graphiques..." -FilePath $logFile
    $videoControllers = Get-WmiObject Win32_VideoController | Select-Object Name, VideoProcessor, DriverVersion, CurrentHorizontalResolution, CurrentVerticalResolution, AdapterRAM
    $videoControllers | Out-File "$outputFolder\Video_Controllers.txt"
    
    # 18. Liste des programmes installés (méthode alternative pour capter plus de logiciels)
    Write-Log -Message "Collecte complète des programmes installés..." -FilePath $logFile
    $installedPrograms = @()
    $installedPrograms += Get-ItemProperty "HKLM:\Software\Microsoft\Windows\CurrentVersion\Uninstall\*" |
    Where-Object { $_.DisplayName -ne $null } |
    Select-Object DisplayName, DisplayVersion, Publisher, InstallDate
    
    try
    {
       $installedPrograms += Get-ItemProperty "HKCU:\Software\Microsoft\Windows\CurrentVersion\Uninstall\*" |
        Where-Object { $_.DisplayName -ne $null } |
        Select-Object DisplayName, DisplayVersion, Publisher, InstallDate
    }
    catch
    {
        Write-Log -Message "Impossible d'accéder aux programmes installés dans HKCU: $($_.Exception.Message)" -FilePath $logFile
    }
    
    try
    {
        if (Test-Path "HKLM:\Software\Wow6432Node\Microsoft\Windows\CurrentVersion\Uninstall\*")
        {
            $installedPrograms += Get-ItemProperty "HKLM:\Software\Wow6432Node\Microsoft\Windows\CurrentVersion\Uninstall\*" |
            Where-Object { $_.DisplayName -ne $null } |
            Select-Object DisplayName, DisplayVersion, Publisher, InstallDate
        }
    }
    catch
    {
        Write-Log -Message "Impossible d'accéder aux programmes 32-bit installés: $($_.Exception.Message)" -FilePath $logFile
    }
    
    $installedPrograms | Sort-Object DisplayName -Unique | Out-File "$outputFolder\Complete_Installed_Programs.txt"
    
    # 19. Informations sur les moniteurs connectés
    Write-Log -Message "Collecte des informations sur les moniteurs..." -FilePath $logFile
    try
    {
        $monitors = Get-WmiObject WmiMonitorID -Namespace root\wmi |
        ForEach-Object {
            $manufacturer = [System.Text.Encoding]::ASCII.GetString($_.ManufacturerName -ne 0)
            $name = [System.Text.Encoding]::ASCII.GetString($_.UserFriendlyName -ne 0)
            $serial = [System.Text.Encoding]::ASCII.GetString($_.SerialNumberID -ne 0)
            
            [PSCustomObject]@{
                Manufacturer = $manufacturer
                Name = $name
                SerialNumber = $serial
            }
        }
        
        $monitors | Out-File "$outputFolder\Monitors.txt"
    }
    catch
    {
        Write-Log -Message "Impossible d'obtenir les informations des moniteurs: $($_.Exception.Message)" -FilePath $logFile
    }
    
    # 20. Génération d'un rapport HTML détaillé
    Write-Log -Message "Génération du rapport HTML..." -FilePath $logFile
    
    # Explications pour les paramètres non compatibles
    $uefiExplanation = if ($uefiStatus -ne "Activé")
    {
        "<p class='danger'>Pour activer le mode UEFI, vous devez accéder au BIOS/UEFI de votre ordinateur au démarrage (généralement touche F2, F10, DEL ou ESC) et changer le mode de démarrage de Legacy/CSM à UEFI uniquement. Attention : cela peut nécessiter une réinstallation du système d'exploitation.</p>"
    }
    else { "" }
    
    $secureBootExplanation = if (!$secureBootState)
    {
        "<p class='warning'>Pour activer Secure Boot, accédez au BIOS/UEFI de votre ordinateur et activez l'option Secure Boot dans les paramètres de sécurité. Assurez-vous que le système est en mode UEFI avant d'activer Secure Boot.</p>"
    }
    else { "" }
    
    $tpmExplanation = if (!$tpmPresent)
    {
        "<p class='danger'>Le TPM (Trusted Platform Module) est nécessaire pour Windows 11. Si votre carte mère le supporte, vous pouvez l'activer dans le BIOS/UEFI. Sur certains systèmes, il peut être désigné comme 'Security Device', 'Security Chip' ou 'PTT' (pour les systèmes Intel).</p>"
    }
    else { "" }
    
    $htmlReport = @"
<!DOCTYPE html>
<html>
<head>
    <title>Rapport de compatibilité Windows 11 - $userName ($computerName)</title>
    <style>
        body { font-family: Arial, sans-serif; margin: 20px; }
        h1 { color: #0078D7; }
        h2 { color: #0078D7; border-bottom: 1px solid #0078D7; padding-bottom: 5px; }
        table { border-collapse: collapse; width: 100%; margin-bottom: 20px; }
        th, td { border: 1px solid #ddd; padding: 8px; text-align: left; }
        th { background-color: #f2f2f2; }
        tr:nth-child(even) { background-color: #f9f9f9; }
        .success { color: green; font-weight: bold; }
        .warning { color: orange; font-weight: bold; }
        .danger { color: red; font-weight: bold; }
        .summary { margin: 20px 0; padding: 15px; background-color: #f0f7ff; border-left: 5px solid #0078D7; }
        .explanation { margin: 10px 0; padding: 10px; background-color: #fffce8; border-left: 5px solid #ffcc00; }
    </style>
</head>
<body>
    <h1>Rapport de compatibilité Windows 11</h1>
    <p>Utilisateur: <strong>$userName</strong> | Structure: <strong>$structure</strong> | Ordinateur: <strong>$computerName</strong> | Date du scan: <strong>$(Get-Date -Format "dd/MM/yyyy HH:mm")</strong></p>
    
    <div class="summary">
        <h2>Résumé de compatibilité</h2>
        <ul>
"@
    
    $allCompatible = $true
    foreach ($item in $compatibility)
    {
        if ($item -match "Non compatible")
        {
            $htmlReport += "<li class='danger'>$item</li>`n"
            $allCompatible = $false
        }
        elseif ($item -match "Configuration requise" -or $item -match "Potentiellement non compatible")
        {
            $htmlReport += "<li class='warning'>$item</li>`n"
            $allCompatible = $false
        }
        else
        {
            $htmlReport += "<li class='success'>$item</li>`n"
        }
    }
    
    $overallStatus = if ($allCompatible)
    {
        "<p class='success'>✅ Ce poste est compatible avec Windows 11</p>"
    }
    else
    {
        "<p class='danger'>❌ Ce poste n'est PAS entièrement compatible avec Windows 11</p>"
    }
    
    $htmlReport += @"
        </ul>
        $overallStatus
    </div>
    <div class="explanation">
        <h2>Comment résoudre les problèmes de compatibilité</h2>
        $uefiExplanation
        $secureBootExplanation
        $tpmExplanation
    </div>
    <h2>Informations système</h2>
    <table>
        <tr><th>Nom du poste</th><td>$($systemInfo.CsName)</td></tr>
        <tr><th>Utilisateur</th><td>$userName</td></tr>
        <tr><th>Structure/Département</th><td>$structure</td></tr>
        <tr><th>Fabricant</th><td>$($systemInfo.CsManufacturer)</td></tr>
        <tr><th>Modèle</th><td>$($systemInfo.CsModel)</td></tr>
        <tr><th>Numéro de série</th><td>$($biosInfo.SerialNumber)</td></tr>
        <tr><th>Windows</th><td>$($systemInfo.WindowsProductName)</td></tr>
        <tr><th>Version</th><td>$($systemInfo.WindowsVersion)</td></tr>
        <tr><th>Build</th><td>$($systemInfo.WindowsBuildLabEx)</td></tr>
        <tr><th>Architecture</th><td>$($systemInfo.OsArchitecture)</td></tr>
    </table>
    <h2>BIOS et Boot</h2>
    <table>
        <tr><th>Version BIOS</th><td>$($biosInfo.SMBIOSBIOSVersion)</td></tr>
        <tr><th>Date BIOS</th><td>$($biosInfo.ReleaseDate)</td></tr>
        <tr><th>Secure Boot</th><td>$secureBootState</td></tr>
        <tr><th>Mode UEFI</th><td>$uefiStatus</td></tr>
    </table>
    <h2>Module TPM</h2>
    <table>
        <tr><th>TPM Présent</th><td>$tpmPresent</td></tr>
        <tr><th>TPM Activé</th><td>$tpmEnabled</td></tr>
        <tr><th>Version TPM</th><td>$tpmVersion</td></tr>
    </table>
    <h2>Processeur</h2>
    <table>
        <tr><th>Modèle</th><td>$($cpuInfo.Name)</td></tr>
        <tr><th>Fabricant</th><td>$($cpuInfo.Manufacturer)</td></tr>
        <tr><th>Nombre de cœurs</th><td>$($cpuInfo.NumberOfCores)</td></tr>
        <tr><th>Nombre de threads</th><td>$($cpuInfo.NumberOfLogicalProcessors)</td></tr>
        <tr><th>Fréquence (MHz)</th><td>$($cpuInfo.MaxClockSpeed)</td></tr>
    </table>
    <h2>Carte(s) graphique(s)</h2>
    <table>
        <tr><th>Modèle</th><th>Processeur</th><th>Version du pilote</th><th>Résolution</th><th>Mémoire vidéo</th></tr>
"@
    
    foreach ($gpu in $videoControllers)
    {
        $vram = if ($gpu.AdapterRAM) { "$([math]::Round($gpu.AdapterRAM / 1MB, 0)) MB" }
        else { "N/A" }
        $resolution = if ($gpu.CurrentHorizontalResolution) { "$($gpu.CurrentHorizontalResolution) x $($gpu.CurrentVerticalResolution)" }
        else { "N/A" }
        $htmlReport += "<tr><td>$($gpu.Name)</td><td>$($gpu.VideoProcessor)</td><td>$($gpu.DriverVersion)</td><td>$resolution</td><td>$vram</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <h2>Mémoire RAM</h2>
    <table>
        <tr><th>Mémoire totale</th><td>$([math]::Round($ram.Sum / 1GB, 2)) GB</td></tr>
    </table>
    <table>
        <tr><th>Emplacement</th><th>Fabricant</th><th>Référence</th><th>Capacité (GB)</th><th>Vitesse (MHz)</th></tr>
"@
    
    foreach ($module in $ramInfo)
    {
        $htmlReport += "<tr><td>$($module.DeviceLocator)</td><td>$($module.Manufacturer)</td><td>$($module.PartNumber)</td><td>$($module.'Capacity(GB)')</td><td>$($module.Speed)</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <h2>Moniteurs connectés</h2>
    <table>
        <tr><th>Fabricant</th><th>Modèle</th><th>Numéro de série</th></tr>
"@
    
    if ($monitors -and $monitors.Count -gt 0)
    {
        foreach ($monitor in $monitors)
        {
            $htmlReport += "<tr><td>$($monitor.Manufacturer)</td><td>$($monitor.Name)</td><td>$($monitor.SerialNumber)</td></tr>`n"
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='3'>Aucun moniteur détecté ou information non disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <h2>Disques et stockage</h2>
    <table>
        <tr><th>Modèle</th><th>Taille (GB)</th><th>Type</th></tr>
"@
    
    if ($diskInfo -and $diskInfo.GetType().Name -ne "Object[]")
    {
        # Pour les disques obtenus via Get-Disk
        foreach ($disk in $diskInfo)
        {
            try
            {
                $htmlReport += "<tr><td>$($disk.FriendlyName)</td><td>$([math]::Round($disk.Size / 1GB, 2))</td><td>$($disk.BusType)</td></tr>`n"
            }
            catch
            {
                # En cas d'erreur, essayer une autre approche
                $htmlReport += "<tr><td>$($disk.Model)</td><td>$([math]::Round($disk.Size / 1GB, 2))</td><td>$($disk.InterfaceType)</td></tr>`n"
            }
        }
    }
    elseif ($diskInfo)
    {
        # Pour les disques obtenus via WMI
        foreach ($disk in $diskInfo)
        {
            try
            {
                $htmlReport += "<tr><td>$($disk.Model)</td><td>$([math]::Round($disk.Size / 1GB, 2))</td><td>$($disk.InterfaceType)</td></tr>`n"
            }
            catch
            {
                $htmlReport += "<tr><td>$($disk.Caption)</td><td>$([math]::Round(($disk.Size / 1GB), 2))</td><td>$($disk.MediaType)</td></tr>`n"
            }
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='3'>Aucune information de disque disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    
    <table>
        <tr><th>Lettre</th><th>Étiquette</th><th>Format</th><th>Taille (GB)</th><th>Espace libre (GB)</th><th>% Libre</th></tr>
"@
    
    if ($volumeInfo -and $volumeInfo.GetType().Name -ne "Object[]")
    {
        # Pour les volumes obtenus via Get-Volume
        foreach ($volume in $volumeInfo | Where-Object { $_.DriveLetter })
        {
            try
            {
                $percentFree = if ($volume.Size -gt 0) { [math]::Round(($volume.SizeRemaining / $volume.Size) * 100, 2) }
                else { 0 }
                $htmlReport += "<tr><td>$($volume.DriveLetter)</td><td>$($volume.FileSystemLabel)</td><td>$($volume.FileSystem)</td><td>$([math]::Round($volume.Size / 1GB, 2))</td><td>$([math]::Round($volume.SizeRemaining / 1GB, 2))</td><td>$percentFree %</td></tr>`n"
            }
            catch
            {
                # Gestion d'erreur
            }
        }
    }
    elseif ($volumeInfo)
    {
        # Pour les volumes obtenus via WMI
        foreach ($volume in $volumeInfo)
        {
            try
            {
                $percentFree = if ($volume.Size -gt 0) { [math]::Round(($volume.FreeSpace / $volume.Size) * 100, 2) }
                else { 0 }
                $htmlReport += "<tr><td>$($volume.DeviceID.Replace(':', ''))</td><td>$($volume.VolumeName)</td><td>$($volume.FileSystem)</td><td>$([math]::Round($volume.Size / 1GB, 2))</td><td>$([math]::Round($volume.FreeSpace / 1GB, 2))</td><td>$percentFree %</td></tr>`n"
            }
            catch
            {
                # Gestion d'erreur
            }
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='6'>Aucune information de volume disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <h2>Réseau</h2>
    <table>
        <tr><th>Nom</th><th>État</th><th>Type</th><th>Vitesse</th></tr>
"@
    
    if ($networkAdapters -and $networkAdapters.GetType().Name -ne "Object[]")
    {
        # Pour les adaptateurs obtenus via Get-NetAdapter
        foreach ($adapter in $networkAdapters)
        {
            try
            {
                $htmlReport += "<tr><td>$($adapter.Name)</td><td>$($adapter.Status)</td><td>$($adapter.InterfaceDescription)</td><td>$($adapter.LinkSpeed)</td></tr>`n"
            }
            catch
            {
                # Gestion d'erreur
            }
        }
    }
    elseif ($networkAdapters)
    {
        # Pour les adaptateurs obtenus via WMI
        foreach ($adapter in $networkAdapters)
        {
            try
            {
                $status = if ($adapter.NetEnabled) { "Up" }
                else { "Down" }
                $htmlReport += "<tr><td>$($adapter.NetConnectionID)</td><td>$status</td><td>$($adapter.Description)</td><td>$($adapter.Speed) bps</td></tr>`n"
            }
            catch
            {
                # Gestion d'erreur
            }
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='4'>Aucune information réseau disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <h2>Périphériques USB</h2>
    <table>
        <tr><th>Nom</th><th>État</th></tr>
"@
    
    if ($usbDevices -and $usbDevices.Count -gt 0)
    {
        $usbDisplayLimit = [Math]::Min($usbDevices.Count, 20)
        for ($i = 0; $i -lt $usbDisplayLimit; $i++)
        {
            try
            {
                $device = $usbDevices[$i]
                $deviceName = if ($device.FriendlyName) { $device.FriendlyName }
                elseif ($device.Caption) { $device.Caption }
                else { $device.Name }
                $deviceStatus = if ($device.Status) { $device.Status }
                else { "Inconnu" }
                $htmlReport += "<tr><td>$deviceName</td><td>$deviceStatus</td></tr>`n"
            }
            catch
            {
                # Gestion d'erreur
            }
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='2'>Aucun périphérique USB détecté ou information non disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <p>Note: Limité aux 20 premiers périphériques USB. Le rapport complet contient tous les périphériques.</p>
    <h2>Mises à jour Windows récentes</h2>
    <table>
        <tr><th>ID</th><th>Description</th><th>Date d'installation</th></tr>
"@
    
    if ($updates -and $updates.Count -gt 0)
    {
        $recentUpdates = $updates | Select-Object -First 10
        foreach ($update in $recentUpdates)
        {
            $htmlReport += "<tr><td>$($update.HotFixID)</td><td>$($update.Description)</td><td>$($update.InstalledOn)</td></tr>`n"
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='3'>Aucune mise à jour récente détectée ou information non disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <h2>Logiciels installés (10 exemples)</h2>
    <table>
        <tr><th>Nom</th><th>Version</th><th>Éditeur</th></tr>
"@
    
    if ($installedPrograms -and $installedPrograms.Count -gt 0)
    {
        $recentSoftware = $installedPrograms | Select-Object -First 10
        foreach ($app in $recentSoftware)
        {
            $appName = if ($app.DisplayName) { $app.DisplayName }
            else { $app.Name }
            $appVersion = if ($app.DisplayVersion) { $app.DisplayVersion }
            else { $app.Version }
            $appPublisher = if ($app.Publisher) { $app.Publisher }
            else { $app.Vendor }
            $htmlReport += "<tr><td>$appName</td><td>$appVersion</td><td>$appPublisher</td></tr>`n"
        }
    }
    else
    {
        $htmlReport += "<tr><td colspan='3'>Aucun logiciel détecté ou information non disponible</td></tr>`n"
    }
    
    $htmlReport += @"
    </table>
    <p>Note: Le rapport complet contient la liste complète des logiciels.</p>
    <div style="margin-top: 30px; font-size: 12px; color: #666; text-align: center; border-top: 1px solid #ddd; padding-top: 10px;">
        Rapport généré automatiquement le $(Get-Date -Format "dd/MM/yyyy à HH:mm") | Stéphan Informatique
    </div>
</body>
</html>
"@
    
    $htmlReportPath = "$outputFolder\Rapport_Windows11_${userName}_${structure}_$computerName.html"
    $htmlReport | Out-File -FilePath $htmlReportPath -Encoding UTF8
    
    # 21. Créer un fichier ZIP avec tous les résultats
    Write-Log -Message "Compression des résultats..." -FilePath $logFile
    $zipFilePath = "$scriptPath\Rapport_Windows11_${userName}_${structure}_$computerName.zip"
    Compress-Archive -Path $outputFolder -DestinationPath $zipFilePath -Force
    
    # 22. Envoi du rapport par e-mail (optionnel)
    if ($sendEmailEnabled)
    {
        Write-Log -Message "Préparation de l'envoi par e-mail..." -FilePath $logFile
        
        $emailBody = @"
<html>
<body style="font-family: Arial, sans-serif;">
<h2>Rapport de compatibilité Windows 11</h2>
<p>Bonjour,</p>
<p>Veuillez trouver ci-joint le rapport de compatibilité Windows 11 pour :</p>
<ul>
<li><strong>Utilisateur:</strong> $userName</li>
<li><strong>Structure/Département:</strong> $structure</li>
<li><strong>Poste:</strong> $computerName</li>
<li><strong>Date du scan:</strong> $(Get-Date -Format "dd/MM/yyyy à HH:mm")</li>
</ul>
<p>Le rapport est disponible en format HTML pour consultation rapide et également en ZIP pour accéder à l'ensemble des données techniques collectées.</p>
<p>Cordialement,<br>
Stéphan Informatique</p>
</body>
</html>
"@
        
        $emailResult = Send-ReportEmail -Subject "Rapport Windows 11 - $userName - $structure - $computerName" `
                                       -Body $emailBody `
                                       -Attachments @($htmlReportPath, $zipFilePath)
        
        if ($emailResult)
        {
            Write-Log -Message "Envoi du rapport par e-mail réussi" -FilePath $logFile
            Write-Host "Rapport envoyé avec succès à $($smtpSettings.To)" -ForegroundColor Green
        }
        else
        {
            Write-Log -Message "Échec de l'envoi du rapport par e-mail" -FilePath $logFile
            Write-Host "Échec de l'envoi du rapport par e-mail" -ForegroundColor Red
        }
    }
    
    # Afficher un résumé des résultats
    Write-Host "`n============ RÉSUMÉ DE COMPATIBILITÉ WINDOWS 11 ============" -ForegroundColor Cyan
    Write-Host "Poste: $computerName | Utilisateur: $userName | Structure: $structure" -ForegroundColor Cyan
    Write-Host "--------------------------------------------------------" -ForegroundColor Cyan
    
    foreach ($item in $compatibility)
    {
        if ($item -match "Non compatible")
        {
            Write-Host $item -ForegroundColor Red
        }
        elseif ($item -match "Configuration requise" -or $item -match "Potentiellement non compatible")
        {
            Write-Host $item -ForegroundColor Yellow
        }
        else
        {
            Write-Host $item -ForegroundColor Green
        }
    }
    
    Write-Host "--------------------------------------------------------" -ForegroundColor Cyan
    if ($allCompatible)
    {
        Write-Host "✅ Ce poste EST COMPATIBLE avec Windows 11" -ForegroundColor Green
    }
    else
    {
        Write-Host "❌ Ce poste N'EST PAS entièrement compatible avec Windows 11" -ForegroundColor Red
    }
    Write-Host "--------------------------------------------------------" -ForegroundColor Cyan
    
