				function Extract-DriversFromExternal
				{
					$statusLabel.Text = "Sélection du dossier Windows source (externe)..."
					$sourceWindows = Select-Folder -Description "Sélectionnez le dossier Windows de l'installation à extraire (ex: E:\Windows)"
					if ($sourceWindows -eq $null)
					{
						$statusLabel.Text = "Extraction annulée."
						return
					}
					
					$destination = Select-Folder -Description "Sélectionnez le dossier de destination pour les pilotes extraits"
					if ($destination -eq $null)
					{
						$statusLabel.Text = "Extraction annulée."
						return
					}
					
					try
					{
						$timestamp = Get-Date -Format "yyyyMMdd_HHmmss"
						$backupFolder = Join-Path $destination "DriverExtract_$timestamp"
						New-Item -Path $backupFolder -ItemType Directory -Force | Out-Null
						
						$statusLabel.Text = "Extraction des pilotes en cours..."
						$output = Invoke-CommandWithProgress -Title "Extraction des pilotes" -Operation "Extraction depuis $sourceWindows\System32\DriverStore\FileRepository" -ScriptBlock {
							$winDir = "$using:sourceWindows"
							& dism.exe /Image:"$winDir" /Export-Driver /Destination:"$using:backupFolder" 2>&1
						}
						
						$statusLabel.Text = "Extraction terminée."
						[System.Windows.Forms.MessageBox]::Show(
							"Extraction des pilotes terminée avec succès.`nDossier de destination : $backupFolder",
							"Extraction terminée",
							[System.Windows.Forms.MessageBoxButtons]::OK,
							[System.Windows.Forms.MessageBoxIcon]::Information
						)
					}
					catch
