				# Fonction pour sélectionner un dossier avec interface améliorée
				function Select-Folder
				{
					param (
						[string]$Description = "Sélectionnez un dossier"
					)
					
					$folderBrowser = New-Object System.Windows.Forms.FolderBrowserDialog
					$folderBrowser.Description = $Description
					$folderBrowser.ShowNewFolderButton = $true
					$folderBrowser.RootFolder = [System.Environment+SpecialFolder]::MyComputer
					
					$result = $folderBrowser.ShowDialog()
					
					if ($result -eq [System.Windows.Forms.DialogResult]::OK)
					{
						return $folderBrowser.SelectedPath
					}
					return $null
				}
				
				# Fonction pour exécuter des commandes avec gestion de progression
				function Invoke-CommandWithProgress
				{
					param (
						[string]$Title,
						[string]$Operation,
						[scriptblock]$ScriptBlock
					)
					
					# Création d'une fenêtre de progression
					$progressForm = New-Object System.Windows.Forms.Form
					$progressForm.Text = $Title
					$progressForm.Size = New-Object System.Drawing.Size(400, 150)
					$progressForm.StartPosition = 'CenterParent'
					$progressForm.FormBorderStyle = 'FixedDialog'
					$progressForm.ControlBox = $false
					
					$operationLabel = New-Object System.Windows.Forms.Label
					$operationLabel.Location = New-Object System.Drawing.Point(10, 20)
					$operationLabel.Size = New-Object System.Drawing.Size(380, 20)
					$operationLabel.Text = $Operation
					$progressForm.Controls.Add($operationLabel)
					
					$progressBar = New-Object System.Windows.Forms.ProgressBar
					$progressBar.Location = New-Object System.Drawing.Point(10, 50)
					$progressBar.Size = New-Object System.Drawing.Size(380, 30)
					$progressBar.Style = [System.Windows.Forms.ProgressBarStyle]::Marquee
					$progressForm.Controls.Add($progressBar)
					
					$statusLabel = New-Object System.Windows.Forms.Label
					$statusLabel.Location = New-Object System.Drawing.Point(10, 90)
					$statusLabel.Size = New-Object System.Drawing.Size(380, 20)
					$statusLabel.Text = "Veuillez patienter..."
					$progressForm.Controls.Add($statusLabel)
					
					# Démarrer la tâche dans un thread séparé
					$progressForm.Show()
					$progressForm.Refresh()
					
					try
					{
						# Exécution du script dans un job PowerShell
						$job = Start-Job -ScriptBlock $ScriptBlock
						
						# Attente de la fin du job avec mise à jour de l'interface
						while ($job.State -eq "Running")
						{
							Start-Sleep -Milliseconds 100
							[System.Windows.Forms.Application]::DoEvents()
						}
						
						# Récupération des résultats
						$result = Receive-Job -Job $job
						Remove-Job -Job $job
						
						$progressForm.Close()
						return $result
					}
					catch
					{
						$progressForm.Close()
						throw $_
					}
				}
				
				# Fonction pour sauvegarder les pilotes
				function Backup-Drivers
				{
					$statusLabel.Text = "Sélection du dossier de destination..."
					$destination = Select-Folder -Description "Sélectionnez un dossier pour la sauvegarde des pilotes"
					
					if ($destination -eq $null)
					{
						$statusLabel.Text = "Sauvegarde annulée."
						return
					}
					
					try
					{
						# Créer le dossier de sauvegarde avec date et heure
						$timestamp = Get-Date -Format "yyyyMMdd_HHmmss"
						$backupFolder = Join-Path $destination "DriverBackup_$timestamp"
						New-Item -Path $backupFolder -ItemType Directory -Force | Out-Null
						
						$statusLabel.Text = "Sauvegarde des pilotes en cours..."
						
						$output = Invoke-CommandWithProgress -Title "Sauvegarde des pilotes" -Operation "Exportation des pilotes vers $backupFolder" -ScriptBlock {
							$result = & dism.exe /Online /Export-Driver /Destination:"$using:backupFolder" 2>&1
							return $result
						}
						
						# Création d'un fichier texte avec les informations
						$infoFilePath = Join-Path $backupFolder "info_sauvegarde.txt"
						$computerInfo = Get-CimInstance Win32_ComputerSystem | Select-Object Manufacturer, Model
						$osInfo = Get-CimInstance Win32_OperatingSystem | Select-Object Caption, Version, BuildNumber
						
						"Sauvegarde de pilotes" | Out-File -FilePath $infoFilePath -Encoding utf8
						"Date: $(Get-Date)" | Out-File -FilePath $infoFilePath -Append -Encoding utf8
						"Ordinateur: $($computerInfo.Manufacturer) $($computerInfo.Model)" | Out-File -FilePath $infoFilePath -Append -Encoding utf8
						"Système: $($osInfo.Caption) (build $($osInfo.BuildNumber))" | Out-File -FilePath $infoFilePath -Append -Encoding utf8
						"-----------------------------------" | Out-File -FilePath $infoFilePath -Append -Encoding utf8
						$output | Out-File -FilePath $infoFilePath -Append -Encoding utf8
						
						$statusLabel.Text = "Sauvegarde terminée."
						
						[System.Windows.Forms.MessageBox]::Show(
							"Sauvegarde des pilotes terminée avec succès.`n`nDossier de sauvegarde: $backupFolder`n`nNombre de pilotes sauvegardés: $((Get-ChildItem -Path $backupFolder -Filter *.inf -Recurse).Count)",
							"Sauvegarde terminée",
							[System.Windows.Forms.MessageBoxButtons]::OK,
							[System.Windows.Forms.MessageBoxIcon]::Information
						)
					}
					catch
					{
						$statusLabel.Text = "Erreur lors de la sauvegarde."
						[System.Windows.Forms.MessageBox]::Show(
							"Une erreur est survenue lors de la sauvegarde des pilotes:`n`n$_",
							"Erreur",
							[System.Windows.Forms.MessageBoxButtons]::OK,
							[System.Windows.Forms.MessageBoxIcon]::Error
						)
					}
				}
				
				# Fonction pour restaurer les pilotes
				function Restore-Drivers
				{
					$statusLabel.Text = "Sélection du dossier source..."
					$source = Select-Folder -Description "Sélectionnez le dossier contenant les pilotes à restaurer"
					
					if ($source -eq $null)
					{
						$statusLabel.Text = "Restauration annulée."
						return
					}
					
					# Vérifier que le dossier contient des pilotes
					$driverFiles = Get-ChildItem -Path $source -Filter *.inf -Recurse
					if ($driverFiles.Count -eq 0)
					{
						$statusLabel.Text = "Aucun pilote trouvé dans le dossier sélectionné."
						[System.Windows.Forms.MessageBox]::Show(
							"Aucun fichier de pilote (.inf) n'a été trouvé dans le dossier sélectionné.`n`nVeuillez sélectionner un dossier valide contenant des pilotes.",
							"Aucun pilote trouvé",
							[System.Windows.Forms.MessageBoxButtons]::OK,
							[System.Windows.Forms.MessageBoxIcon]::Warning
						)
						return
					}
					
					# Confirmation avant restauration
					$confirmation = [System.Windows.Forms.MessageBox]::Show(
						"Voulez-vous vraiment restaurer les pilotes depuis le dossier:`n$source`n`nNombre de pilotes détectés: $($driverFiles.Count)",
						"Confirmation de restauration",
						[System.Windows.Forms.MessageBoxButtons]::YesNo,
						[System.Windows.Forms.MessageBoxIcon]::Question
					)
					
					if ($confirmation -eq [System.Windows.Forms.DialogResult]::No)
					{
						$statusLabel.Text = "Restauration annulée."
						return
					}
					
					try
