# Fonction pour obtenir le ProgID actuel d'une extension
function Get-ExtensionProgId {
    param (
        [Parameter(Mandatory = $true)]
        [string]$Extension
    )
    
    # S'assurer que l'extension commence par un point
    if (-not $Extension.StartsWith(".")) {
        $Extension = ".$Extension"
    }
    
    try {
        $assoc = cmd /c assoc $Extension 2>&1
        if ($assoc -match "$Extension=(.+)$") {
            return $Matches[1]
        }
    }
    catch {
        return $null
    }
    
    return $null
}

# Fonction pour vérifier si un ProgID est valide
function Test-ProgIdValid {
    param (
        [Parameter(Mandatory = $true)]
        [string]$ProgId
    )
    
    try {
        $ftypeOutput = cmd /c ftype $ProgId 2>&1
        return -not ($LASTEXITCODE -ne 0 -or $ftypeOutput -match "ERROR" -or $ftypeOutput -match "introuvable")
    }
    catch {
        return $false
    }
}

