# Fonction pour récupérer et traiter le fichier XML distant
function Process-RemoteXml {
    param (
        [Parameter(Mandatory = $true)]
        [string]$XmlUrl
    )
    
    Write-Host "Téléchargement et traitement du fichier XML distant..." -ForegroundColor Cyan
    
    try {
        # Télécharger le fichier XML
        $webClient = New-Object System.Net.WebClient
        $xmlContent = $webClient.DownloadString($XmlUrl)
        
        # Charger le contenu XML
        $xml = [xml]$xmlContent
        
        $xmlHeader = @"
<?xml version="1.0" encoding="UTF-8"?>
<DefaultAssociations>
"@
        
        $xmlFooter = @"
</DefaultAssociations>
"@
        
        $newXmlContent = $xmlHeader
        $validAssociations = 0
        $invalidAssociations = 0
        
        # Afficher un en-tête de tableau pour les associations
        Write-Host ""
        Write-Host "┌─────────────────────────────────────┬──────────────────────────────────┬───────────┐"
        Write-Host "│ Extension                           │ Programme                         │ Statut    │"
        Write-Host "├─────────────────────────────────────┼──────────────────────────────────┼───────────┤"
        
        foreach ($association in $xml.DefaultAssociations.Association) {
            $extension = $association.Identifier
            $progId = $association.ProgId
            
            # Vérifier si le ProgID est valide sur ce système
            $isValid = Test-ProgIdValid -ProgId $progId
            
            # Afficher dans le tableau
            $statusText = if ($isValid) { "Valide" } else { "Invalide" }
            $statusColor = if ($isValid) { "Green" } else { "Red" }
            
            # Formater l'affichage pour le tableau
            $extPadded = $extension.PadRight(35).Substring(0, 35)
            $progPadded = $progId.PadRight(34).Substring(0, 34)
            
            Write-Host -NoNewline "│ $extPadded │ $progPadded │ "
            Write-Host -NoNewline $statusText.PadRight(9) -ForegroundColor $statusColor
            Write-Host "│"
            
            if ($isValid) {
                $newXmlContent += "    <Association Identifier=`"$extension`" ProgId=`"$progId`" ApplicationName=`"`" />`r`n"
                $validAssociations++
            }
            else {
                $invalidAssociations++
                
                # Si ProgID invalide, essayer de trouver un ProgID valide pour cette extension
                $currentProgId = Get-ExtensionProgId -Extension $extension
                if ($currentProgId -and (Test-ProgIdValid -ProgId $currentProgId)) {
                    $newXmlContent += "    <Association Identifier=`"$extension`" ProgId=`"$currentProgId`" ApplicationName=`"`" />`r`n"
                    $validAssociations++
                    
                    # Afficher l'alternative trouvée
                    $extPadded = $extension.PadRight(35).Substring(0, 35)
                    $progPadded = $currentProgId.PadRight(34).Substring(0, 34)
                    
                    Write-Host -NoNewline "│ $extPadded │ $progPadded │ "
                    Write-Host -NoNewline "Alternative".PadRight(9) -ForegroundColor Yellow
                    Write-Host "│"
                }
            }
        }
        
        Write-Host "└─────────────────────────────────────┴──────────────────────────────────┴───────────┘"
        Write-Host ""
        
        $newXmlContent += $xmlFooter
        
        # Enregistrer dans un fichier
        $newXmlContent | Out-File -FilePath $outputXmlPath -Encoding utf8
        
        Write-Host "Fichier XML avec associations valides créé: $outputXmlPath" -ForegroundColor Green
        Write-Host "Associations valides: $validAssociations" -ForegroundColor Green
        Write-Host "Associations invalides remplacées ou ignorées: $invalidAssociations" -ForegroundColor Yellow
        
        return $true
    }
    catch {
        Write-Host "Erreur lors du traitement du fichier XML: $_" -ForegroundColor Red
        return $false
    }
}

# Fonction pour définir une association de fichier via assoc et ftype
function Set-FileAssociation {
    param ([string]$Extension, [string]$ProgId)
    try {
        $assocResult = cmd /c assoc $Extension=$ProgId 2>&1
        if (!($assocResult -match 'ERROR')) {
            Write-Host "✓ Association réussie: $Extension -> $ProgId" -ForegroundColor Green
            return $true
        } else { 
            throw $assocResult 
        }
    } catch { 
        Write-Host "✗ Erreur assoc: $Extension -> $_" -ForegroundColor Red
        return $false
    }
}

# Fonction pour définir une association via le registre
function Set-FileAssociationRegistry {
    param (
        [string]$Extension,
        [string]$ProgId
    )
    
    try {
        # S'assurer que l'extension commence par un point
        if (-not $Extension.StartsWith(".")) {
            $Extension = ".$Extension"
        }
        
        # Définir l'association dans le registre HKLM
        New-Item -Path "HKLM:\SOFTWARE\Classes\$Extension" -Force -ErrorAction SilentlyContinue | Out-Null
        Set-ItemProperty -Path "HKLM:\SOFTWARE\Classes\$Extension" -Name "(Default)" -Value $ProgId -ErrorAction SilentlyContinue
        
        # Définir l'association dans le registre utilisateur (HKCU)
        $userChoicePath = "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\FileExts\$Extension\UserChoice"
        if (Test-Path $userChoicePath) {
            try {
                Remove-Item -Path $userChoicePath -Force -ErrorAction SilentlyContinue
            } catch {
                # Ignorer l'erreur si impossible de supprimer
            }
        }
        
        New-Item -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\FileExts\$Extension\UserChoice" -Force -ErrorAction SilentlyContinue | Out-Null
        Set-ItemProperty -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\FileExts\$Extension\UserChoice" -Name "ProgId" -Value $ProgId -ErrorAction SilentlyContinue
            
        Write-Host "✓ Association registre: $Extension -> $ProgId" -ForegroundColor Green
        return $true
    } catch {
        Write-Host "✗ Erreur registre: $Extension -> $_" -ForegroundColor Red
        return $false
    }
}

# Fonction pour appliquer les associations avec différentes méthodes
function Apply-FileAssociations {
    param (
        [string]$XmlPath
    )
    
    # Méthode 1: Utiliser assoc et ftype
    Write-Host "Application des associations avec assoc..." -ForegroundColor Cyan
    $xml = [xml](Get-Content $XmlPath)
    $successCount = 0
    $errorCount = 0
    
    foreach ($association in $xml.DefaultAssociations.Association) {
        if (Set-FileAssociation -Extension $association.Identifier -ProgId $association.ProgId) {
            $successCount++
        } else {
            $errorCount++
        }
    }
    
    Write-Host "Résultat avec assoc: $successCount réussies, $errorCount échouées" -ForegroundColor Cyan
    
    # Méthode 2: Utiliser le registre pour les extensions importantes
    Write-Host "Application des associations importantes via le registre..." -ForegroundColor Cyan
    $regSuccessCount = 0
    $regErrorCount = 0
    
    $importantExtensions = @(".mp4", ".avi", ".mkv", ".pdf", ".jpg", ".png", ".txt", ".docx", ".xlsx", ".html", ".zip", ".mp3")
    
    foreach ($association in $xml.DefaultAssociations.Association) {
        $extension = $association.Identifier
        
        if ($importantExtensions -contains $extension) {
            if (Set-FileAssociationRegistry -Extension $extension -ProgId $association.ProgId) {
                $regSuccessCount++
            } else {
                $regErrorCount++
            }
        }
    }
    
    Write-Host "Résultat via registre: $regSuccessCount réussies, $regErrorCount échouées" -ForegroundColor Cyan
    
    # Méthode 3: Utiliser DISM
    Write-Host "Application des associations via DISM..." -ForegroundColor Cyan
    try {
        $dismResult = & dism.exe /online /Import-DefaultAppAssociations:$XmlPath
        if ($LASTEXITCODE -eq 0) {
            Write-Host "✓ Application DISM réussie" -ForegroundColor Green
        } else {
            Write-Host "✗ Erreur DISM: $dismResult" -ForegroundColor Red
        }
    } catch {
        Write-Host "✗ Exception DISM: $_" -ForegroundColor Red
    }
    
    # Tentative de mise à jour du cache des icônes et d'associations
    Write-Host "Nettoyage du cache des icônes et des associations..." -ForegroundColor Cyan
    
    try {
        # Nettoyer le cache des icônes
        $iconCachePath = "$env:LOCALAPPDATA\IconCache.db"
        if (Test-Path $iconCachePath) {
            Stop-Process -Name explorer -Force -ErrorAction SilentlyContinue
            Start-Sleep -Seconds 1
            Remove-Item -Path $iconCachePath -Force -ErrorAction SilentlyContinue
            Start-Sleep -Seconds 1
        }
        
        # Autres caches d'icônes
        Get-ChildItem -Path "$env:LOCALAPPDATA\Microsoft\Windows\Explorer" -Filter "iconcache*" -ErrorAction SilentlyContinue | ForEach-Object {
            Remove-Item -Path $_.FullName -Force -ErrorAction SilentlyContinue
        }
        
        # Nettoyer le cache des thumbnails
        Get-ChildItem -Path "$env:LOCALAPPDATA\Microsoft\Windows\Explorer\thumbcache*.db" -ErrorAction SilentlyContinue | ForEach-Object {
            Remove-Item -Path $_.FullName -Force -ErrorAction SilentlyContinue
        }
        
        # Rafraîchir l'explorateur
        Start-Process explorer
        Write-Host "✓ Cache nettoyé et explorateur redémarré" -ForegroundColor Green
    } catch {
        Write-Host "✗ Erreur lors du nettoyage du cache: $_" -ForegroundColor Red
    }
    
    return @{
        AssocSuccess = $successCount
        AssocError = $errorCount
        RegSuccess = $regSuccessCount
        RegError = $regErrorCount
    }
}

