					function Exporter-ClesWiFi
					{
						param (
							[string]$cheminExportation
						)
						$logExportation = ""
						if (-not (Test-Path -Path $cheminExportation))
						{
							New-Item -Path $cheminExportation -ItemType Directory
						}
						
						netsh wlan show profiles | Select-String -Pattern "Profil Tous les utilisateurs\s+:\s(.+)$" | ForEach-Object {
							$nomProfil = $_.Matches.Groups[1].Value.Trim()
							$fichierSortie = Join-Path -Path $cheminExportation -ChildPath "$nomProfil.xml"
							netsh wlan export profile name="$nomProfil" folder=$cheminExportation key=clear
							$logExportation += "Profil exporté : $fichierSortie`n"
						}
						if ($logExportation -ne "")
						{
							[System.Windows.Forms.MessageBox]::Show($logExportation)
						}
