						param (
							[string]$cheminImportation
						)
						$logImportation = ""
						Get-ChildItem -Path $cheminImportation -Filter *.xml | ForEach-Object {
							$fichierProfil = $_.FullName
							netsh wlan add profile filename="$fichierProfil" user=all
							$logImportation += "Profil importé : $fichierProfil`n"
						}
						if ($logImportation -ne "")
						{
							[System.Windows.Forms.MessageBox]::Show($logImportation)
